insert  into `article_dictionaries`(`id`,`created`,`modified`,`article_id`,`user_id`,`lang_id`,`subject`,`content`,`teaser`,`slug`,`counter_comment`,`counter_view`,`counter_user_voting`,`average_voting_point`,`counter_like`,`seo_subject`,`seo_description`,`seo_keyword`,`tags`) values (1,'2013-09-04 17:53:37','2013-09-04 17:53:37',2,1,1,'Sài Gòn ngập trong \'biển nước đen\'','<div class=\"summary\">\r\n<p>Cơn mưa k&eacute;o d&agrave;i đến cuối giờ chiều nay (3/9) đ&atilde; l&agrave;m rất nhiều tuyến đường ở S&agrave;i G&ograve;n bị ngập nặng, giao th&ocirc;ng v&agrave; sinh hoạt của người d&acirc;n bị t&ecirc; liệt ho&agrave;n to&agrave;n.</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"notebox ncenter\">\r\n<p><a href=\"http://news.zing.vn/Clip-nguoi-Sai-Gon-nga-xe-dui-dui-trong-bien-nuoc-den-post349499.html#category_featured.noibat\">Clip người S&agrave;i G&ograve;n ng&atilde; xe d&uacute;i dụi trong &#39;biển nước đen&#39;</a></p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/DONG_DEN_3.JPG\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Nước từ cống &ugrave;n l&ecirc;n trong cơn mưa tại đường Đồng Đen (Q.T&acirc;n B&igrave;nh).</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/DONG_DEN_4.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Thời điểm nước d&acirc;ng cũng l&agrave; l&uacute;c học sinh tan trường n&ecirc;n nhiều phụ huynh phải b&igrave; b&otilde;m dắt xe đưa con về.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/DONG_DEN_5.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Khi xe &ocirc; t&ocirc; chạy qua, h&agrave;ng loạt xe m&aacute;y dựng 2 b&ecirc;n đường bị s&oacute;ng đ&aacute;nh ng&atilde;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/DONG_DEN_7.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Một phụ nữ kh&ocirc;ng giữ được chiếc xe chết m&aacute;y trong l&uacute;c dắt bị s&oacute;ng đ&aacute;nh ng&atilde;, chỉ c&ograve;n thấy tay cầm.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/DONG_DEN_6.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Rất nhiều nh&agrave; v&agrave; h&agrave;ng qu&aacute;n ở đường Đồng Đen bị nước tr&agrave;n v&agrave;o, mọi hoạt động kinh doanh bị t&ecirc; liệt.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/HOA_BINH_2.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tại đường H&ograve;a B&igrave;nh (Q.11), t&igrave;nh trạng ngập nặng k&eacute;o d&agrave;i nhiều giờ.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/HOA_BINH_6.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Xe m&aacute;y bị ngập gần hết y&ecirc;n.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/HOA_BINH_7.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Xe đạp cũng chịu chung số phận.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/HOA_BINH_14.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Biết đường H&ograve;a B&igrave;nh bị ngập nặng nhưng nhiều người vẫn &quot;bơi&quot; qua đoạn đường n&agrave;y về nh&agrave;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/HOA_BINH_11.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Giao th&ocirc;ng bị t&ecirc; liệt. Một chiến sĩ CSGT điều tiết giao th&ocirc;ng tại ng&atilde; 3 H&ograve;a B&igrave;nh - Khu&ocirc;ng Việt.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/HOA_BINH_10.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nước chảy như suối từ đường Ho&agrave; B&igrave;nh v&agrave;o khu du lịch Đầm Sen.&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_03/HOA_BINH_8.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nước tr&agrave;n v&agrave;o nh&agrave; d&acirc;n ở đường H&ograve;a B&igrave;nh, c&aacute;c sinh hoạt bị ảnh hưởng nghi&ecirc;m trọng.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>','Cơn mưa kéo dài đến cuối giờ chiều nay (3/9) đã làm rất nhiều tuyến đường ở Sài Gòn bị ngập nặng, giao thông và sinh hoạt của người dân bị tê liệt hoàn toàn.','Sai-Gon-ngap-trong-bien-nuoc-den',0,0,0,0,0,'','','',''),(2,'2013-09-04 17:55:35','2013-11-14 16:05:54',3,1,1,'1,6 triệu đồng để xem thần đồng guitar Hàn biểu diễn tại VN','<div class=\"summary\">\r\n<p>Những th&ocirc;ng tin ch&iacute;nh thức về liveshow của Sungha Jung đ&atilde; được h&eacute; lộ.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<p>Anh ch&agrave;ng 17 tuổi vẫn được mệnh danh l&agrave; nghệ sĩ với những ng&oacute;n tay v&agrave;ng sẽ c&oacute; 2 đ&ecirc;m diễn ở Việt Nam: 20h ng&agrave;y 18/1/2014 tại Nh&agrave; h&aacute;t Lớn H&agrave; Nội v&agrave; 19h ng&agrave;y 19/1/2014 tại Nh&agrave; h&aacute;t Bến Th&agrave;nh, TP. HCM.</p>\r\n\r\n<p>Sẽ c&oacute; 4 hạng mức v&eacute; được ph&aacute;t h&agrave;nh l&agrave; 600.000 đồng, 999.000 đồng, 1.199.000 đồng v&agrave; 1.599.000 đồng. Thời điểm b&aacute;n v&eacute; sẽ được ban tổ chức th&ocirc;ng b&aacute;o v&agrave;o cuối th&aacute;ng 9.</p>\r\n\r\n<p>C&oacute; t&ecirc;n <em>Sungha Jung Concert Tour in Vietnam 2014, </em>đ&acirc;y l&agrave; sự kiện nằm trong tour diễn v&ograve;ng quanh thế giới của Sungha Jung.</p>\r\n\r\n<p>Sinh năm 1996 v&agrave; chỉ bắt đầu học guitar từ năm 2006 nhưng Sungha Jung đ&atilde; nhanh ch&oacute;ng nổi l&ecirc;n như một hiện tượng v&agrave; được ưu &aacute;i tặng cho biệt danh l&agrave; &quot;thần tượng guitar xứ H&agrave;n&quot;.</p>\r\n\r\n<p>Tương tự như Justin Bieber, Sungha Jung được biết đến qua những clip đăng tr&ecirc;n trang web chia sẻ video nổi tiếng thế giới YouTube. T&iacute;nh đến th&aacute;ng 5, k&ecirc;nh YouTube của Sungha Jung đ&atilde; c&oacute; hơn 2 triệu người đăng k&yacute; theo d&otilde;i với hơn 687 triệu lượt xem. Anh cũng đ&atilde; c&oacute; hơn 15 giải thưởng của trang web n&agrave;y.</p>\r\n\r\n<p>Th&ocirc;ng thường, Sungha Jung mất khoảng 3 ng&agrave;y để học bản mới, thu h&igrave;nh v&agrave; đăng l&ecirc;n YouTube. Anh ch&agrave;ng chơi gần như tất cả c&aacute;c thể loại &acirc;m nhạc, từ pop, rock cho đến jazz v&agrave; đ&atilde; cho ra đời được 4 album.</p>\r\n\r\n<p>Ở H&agrave;n Quốc, Sungha Jung từng hợp t&aacute;c với nhiều ng&ocirc;i sao như 2NE1, G-Dragon, Brown Eyed Girls,...</p>\r\n\r\n<p>Nghe<em> Payphone</em> của Maroon 5 qua tiếng đ&agrave;n của Sungha Jung:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/quyenntl/2013_09_04/sungha_jung.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sungha Jung.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<p>Hồng Giang</p>\r\n\r\n<p>Theo Tri Thức</p>','1,6 triệu đồng để xem thần đồng guitar Hàn biểu diễn tại VN','16-trieu-dong-de-xem-than-dong-guitar-Han-bieu-dien-tai-VN',0,0,0,0,0,'','','',''),(3,'2013-09-04 17:58:07','2013-11-14 15:39:20',4,1,1,'Những nhóm nhạc kỳ cựu vẫn chìm nghỉm tại Kpop','<div class=\"summary\">\r\n<p>D&ugrave; rất t&agrave;i năng v&agrave; ra mắt kh&aacute; l&acirc;u, nhưng Brown Eyed Girls, U-KISS, Ze:A... vẫn chưa c&oacute; được th&agrave;nh c&ocirc;ng như mong đợi.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<p><strong>Brown Eyed Girls</strong></p>\r\n\r\n<p>So với d&agrave;n idol trẻ trung của Kpop hiện nay, Brown Eyed Girls &quot;dừ&quot; hơn hẳn về độ tuổi. C&aacute;c th&agrave;nh vi&ecirc;n trong nh&oacute;m như JeA, Miryo hay Narsha đều ở ngưỡng tuổi 30, c&ograve;n th&agrave;nh vi&ecirc;n trẻ nhất l&agrave; Ga In cũng sinh năm 1987.</p>\r\n\r\n<p>Ở độ tuổi đ&atilde; thuộc h&agrave;ng &quot;b&agrave; c&ocirc;&quot; cộng th&ecirc;m sự yếu k&eacute;m trong c&ocirc;ng t&aacute;c PR của c&ocirc;ng ty quản l&yacute; Nega Network n&ecirc;n t&ecirc;n tuổi của BEG vẫn chỉ mức độ kh&aacute;, thậm ch&iacute; l&agrave; lọt thỏm giữa rừng trai xinh, g&aacute;i đẹp của Kpop. Trong khi đ&oacute;, nhiều đ&agrave;n em như Wonder Girls, KARA, 2NE1, đặc biệt l&agrave; SNSD lại rất đ&igrave;nh đ&aacute;m v&agrave; được đ&aacute;nh gi&aacute; như những girl group h&agrave;ng đầu.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_03/Brown_eyed_girls.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Khởi nghiệp từ năm 2006 với nhiều ca kh&uacute;c như <em>Closer, Love </em>hay<em> My Style, </em>nhưng m&atilde;i đến năm 2009, c&aacute;c c&ocirc; g&aacute;i &quot;mắt n&acirc;u&quot; mới thực sự trở n&ecirc;n nổi tiếng với hit <em>Abracadabra</em>. Tuy l&agrave;m thay đổi sự nghiệp của BEG, nhưng b&agrave;i h&aacute;t n&agrave;y kh&ocirc;ng đủ để gi&uacute;p &quot;chủ nh&acirc;n&quot; của n&oacute; vươn l&ecirc;n top đầu.</p>\r\n\r\n<p>Những bản hit sau đ&oacute; của nh&oacute;m như <em>Sixth Sense, One Summer Night, Cleansing Cream</em> v&agrave; gần đ&acirc;y nhất l&agrave; <em>Kill Bill </em>cũng kh&ocirc;ng c&oacute; được thứ hạng cao tr&ecirc;n c&aacute;c bảng xếp hạng v&agrave; chương tr&igrave;nh &acirc;m nhạc.</p>\r\n\r\n<p><strong>U-KISS</strong></p>\r\n\r\n<p>U-KISS được biết đến như nh&oacute;m nhạc sở hữu ngoại h&igrave;nh s&aacute;ng c&ugrave;ng chất giọng khỏe khắn v&agrave; khả năng vũ đạo ổn. B&ecirc;n cạnh đ&oacute;, c&aacute;c ca kh&uacute;c của nh&oacute;m cũng kh&aacute; bắt tai v&agrave; được y&ecirc;u th&iacute;ch mỗi khi ph&aacute;t h&agrave;nh. Thế nhưng, bất chấp những ưu điểm đ&oacute;, nh&oacute;m vẫn chưa một lần đặt tay l&ecirc;n chiếc cup tuần danh gi&aacute; trong c&aacute;c chương tr&igrave;nh &acirc;m nhạc H&agrave;n Quốc.</p>\r\n\r\n<p>C&oacute; tới 5 năm chinh chiến tại đấu trường Kpop, nhưng so với c&aacute;c đ&agrave;n em như 2PM, BEAST, INFINITE&hellip; mức độ nổi tiếng của U-KISS c&ograve;n rất khi&ecirc;m tốn. Thậm ch&iacute;, nh&oacute;m c&ograve;n bị nhiều &quot;ma mới&quot; vượt mặt v&agrave; kh&ocirc;ng thể lọt v&agrave;o top 40 nh&oacute;m nhạc c&oacute; lượng fan lớn nhất H&agrave;n Quốc tr&ecirc;n DAUM Fancafe.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_03/UKISS.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>B&ugrave; lại, d&ugrave; bị &quot;l&eacute;p vế&quot; tại qu&ecirc; nh&agrave;, nhưng U-KISS lại kh&aacute; nổi tiếng tại c&aacute;c nước l&acirc;n cận, đặc biệt l&agrave; Nhật Bản. Nguy&ecirc;n nh&acirc;n l&agrave; do nh&oacute;m ra mắt ở Nhật trước khi ch&iacute;nh thức tấn c&ocirc;ng Kpop. C&aacute;c ch&agrave;ng trai được fan ở xứ sở hoa anh đ&agrave;o hết l&ograve;ng y&ecirc;u mến. Kh&ocirc;ng chỉ tổ chức th&agrave;nh c&ocirc;ng tour xuy&ecirc;n Nhật, nh&oacute;m c&ograve;n được b&igrave;nh chọn l&agrave; &quot;Nh&oacute;m nhạc H&agrave;n được chờ đ&oacute;n nhất&quot; tại đ&acirc;y.</p>\r\n\r\n<p><strong>Ze:A</strong></p>\r\n\r\n<p>Ra mắt năm 2010, Ze:A từng nhận được sự kỳ vọng rất lớn từ kh&aacute;n giả với danh hiệu &quot;SNSD phi&ecirc;n bản nam&quot;. Đặc biệt, sau bản hit <em>All Day Long</em>, nh&oacute;m đ&atilde; được kh&ocirc;ng &iacute;t người biết đến. Thế nhưng, mải ngủ qu&ecirc;n trong chiến thắng n&ecirc;n cho đến giờ nh&oacute;m vẫn chưa thể tho&aacute;t khỏi c&aacute;i b&oacute;ng qu&aacute; lớn của <em>All Day Long </em>v&agrave; thể trở th&agrave;nh một trong những thần tượng top đầu tại Kpop.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_03/ZeA.png\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Vấn đề lớn nhất k&igrave;m h&atilde;m sự ph&aacute;t triển của Ze:A ch&iacute;nh l&agrave; phong c&aacute;ch v&agrave; qu&aacute;ng b&aacute;. C&aacute;c ca kh&uacute;c gần đ&acirc;y của nh&oacute;m như <em>The Day We Broke Up</em>, <em>Here I am, Beautiful Lady, The Ghost Of Wind&hellip;</em> đều kh&ocirc;ng c&oacute; sự đột ph&aacute; v&agrave; dập khu&ocirc;n trong d&ograve;ng nhạc, phong c&aacute;ch. Do đ&oacute;, hầu hết trong số ch&uacute;ng đều kh&ocirc;ng thể đặt ch&acirc;n l&ecirc;n vị tr&iacute; số 1 tr&ecirc;n c&aacute;c bảng xếp hạng &acirc;m nhạc.</p>\r\n\r\n<p>Ca kh&uacute;c gần đ&acirc;y nhất l&agrave; <em>The Ghost Of Wind</em> cũng chỉ gom về 449.000 lượt xem sau gần 1 th&aacute;ng ra mắt v&agrave; c&oacute; thứ hạng kh&aacute; thấp tr&ecirc;n c&aacute;c BXH.</p>\r\n\r\n<p><strong>Jewelry</strong></p>\r\n\r\n<p>So với <em>Brown Eyed Girls</em>, U-KISS, Ze:A, số phận của nh&oacute;m nhạc nữ Jewelry c&ograve;n th&ecirc; thảm hơn. C&oacute; tới 12 năm hoạt động tại Kpop, nhưng ở thời điểm hiện tại nh&oacute;m vẫn kh&ocirc;ng để lại dấu ấn, thậm ch&iacute;, họ c&ograve;n được nhiều người nhớ đến như một &quot;ma mới&quot; tại H&agrave;n Quốc. Nguy&ecirc;n nh&acirc;n dẫn đến t&igrave;nh trạng tr&ecirc;n l&agrave; do Jewelry thay đổi đội h&igrave;nh qu&aacute; nhiều, những th&agrave;nh vi&ecirc;n ban đầu giờ đều t&aacute;ch nh&oacute;m v&agrave; ph&aacute;t triển sự nghiệp ri&ecirc;ng.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_03/Jewelry.png\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Trở lại l&agrave;ng nhạc H&agrave;n v&agrave;o ng&agrave;y 6/7 với MV chủ đề<em> Hot &amp; Cold,</em> Jewelry nhanh ch&oacute;ng bị lu mờ bởi loạt anh t&agrave;i đ&igrave;nh đ&aacute;m tại Kpop. D&ugrave; đ&acirc;y l&agrave; một ca kh&uacute;c rất bắt tai với sự kết hợp giữa nhạc dance v&agrave; trot, song n&oacute; cũng chỉ vươn l&ecirc;n tới vị tr&iacute; thứ 18 tr&ecirc;n bảng xếp hạng Gaon, 15 tr&ecirc;n KOR Billboard với 544.000 lượt xem sau 1 th&aacute;ng &quot;xuất xưởng&quot;.</p>\r\n\r\n<p>Từ Brown Eyed Girls, Jewelry, Ze:A, U-KISS c&ugrave;ng nhiều nh&oacute;m nhạc &quot;v&ocirc; danh&quot; kh&aacute;c tại Kpop, người h&acirc;m mộ c&oacute; thể thấy giọng h&aacute;t, chất lượng sản phẩm l&agrave; chưa đủ để c&aacute;c sao H&agrave;n c&oacute; được sự ch&uacute; &yacute; từ kh&aacute;n giả. Mỗi năm, Kpop đ&oacute;n th&ecirc;m h&agrave;ng chục, thậm ch&iacute; h&agrave;ng trăm nghệ sĩ, nh&oacute;m nhạc mới. Trong t&igrave;nh trạng n&agrave;y, để th&agrave;nh c&ocirc;ng v&agrave; c&oacute; chỗ đứng, c&aacute;c thần tượng c&ograve;n cần sắm cho m&igrave;nh những &quot;chi&ecirc;u thức&quot; qu&aacute;ng b&aacute; hiệu quả c&ugrave;ng d&ograve;ng nhạc hợp thị hiếu kh&aacute;n giả.</p>\r\n</div>\r\n\r\n<p>Ng&ocirc; Ph&agrave;m</p>','Dù rất tài năng và ra mắt khá lâu, nhưng Brown Eyed Girls, U-KISS, Ze:A... vẫn chưa có được thành công như mong đợi.','Nhung-nhom-nhac-ky-cuu-van-chim-nghim-tai-Kpop',0,0,0,0,0,'','','',''),(4,'2013-09-04 17:59:41','2013-11-14 16:06:05',5,1,1,'Những nô lệ tình dục trong làng nhạc Hàn','<div class=\"content\">\r\n<p>Kpop giờ đ&acirc;y đ&atilde; trở th&agrave;nh một l&agrave;n s&oacute;ng &acirc;m nhạc ảnh hưởng mạnh mẽ khắp to&agrave;n cầu, từ &Aacute; đến &Acirc;u, &Uacute;c, Mỹ, Phi. Người ta kh&ocirc;ng khỏi sững sờ v&agrave; th&aacute;n phục trước sự ph&aacute;t triển như vũ b&atilde;o của Kpop từ những những năm 2000. Cũng kh&ocirc;ng kh&oacute; để nhận ra sức lan tỏa của l&agrave;n s&oacute;ng văn h&oacute;a H&agrave;n Quốc trong lĩnh vực &acirc;m nhạc đ&atilde; v&agrave; đang tiếp tục đe dọa một cuộc x&acirc;m lấn văn h&oacute;a đến c&aacute;c quốc gia kh&aacute;c, trong đ&oacute; c&oacute; Việt Nam.<br />\r\n<br />\r\nRất nhiều b&agrave;i b&aacute;o đưa ra những con số th&agrave;nh t&iacute;ch cao ch&oacute;t v&oacute;t của c&aacute;c ca sĩ Kpop tr&ecirc;n thị trường trong v&agrave; ngo&agrave;i nước. Đ&oacute; l&agrave; kết quả của một c&ocirc;ng nghệ giải tr&iacute; biết c&aacute;ch đ&agrave;o tạo v&agrave; lăng x&ecirc; hiệu quả. Đồng thời kh&ocirc;ng &iacute;t trong số đ&oacute; l&agrave; c&aacute;i gi&aacute; &ldquo;được&rdquo; trả sau những bản hợp đồng &ldquo;n&ocirc; lệ t&igrave;nh dục&rdquo;.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Gianghp/2013_09_02/1376388743-kpop--1-.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kh&ocirc;ng &iacute;t những c&ocirc; g&aacute;i bị &eacute;p l&agrave;m n&ocirc; lệ t&igrave;nh dục ở c&aacute;c l&ograve; luyện ca sĩ H&agrave;n (Ảnh minh họa).</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Những hợp đồng n&ocirc; lệ t&igrave;nh dục bị phanh phui</strong><br />\r\n<br />\r\n2012 l&agrave; một năm showbiz H&agrave;n bị r&uacute;ng động bởi vụ cưỡng d&acirc;m h&agrave;ng loạt c&aacute;c thực tập sinh nữ của một CEO c&ocirc;ng ty giải tr&iacute;.<br />\r\n<br />\r\nOpen World Entertainment vốn l&agrave; một l&ograve; luyện c&aacute;c ng&ocirc;i sao trong l&agrave;ng giải tr&iacute; H&agrave;n, trong đ&oacute; c&oacute; những t&ecirc;n tuổi như nữ diễn vi&ecirc;n Shin Ji Soo (phim Những n&agrave;ng c&ocirc;ng ch&uacute;a nổi tiếng), ca sĩ Jun Jin nh&oacute;m Shinhwa, nh&oacute;m The Boss&hellip; Nhưng th&aacute;ng 4/2012, c&ocirc;ng ty n&agrave;y đ&atilde; ho&agrave;n to&agrave;n bị sụp đổ danh tiếng v&igrave; scandal n&ocirc; lệ t&igrave;nh dục m&agrave; thủ phạm lại ch&iacute;nh l&agrave; một gi&aacute;m đốc đại diện giữ chức vụ CEO, t&ecirc;n Jang Suk Woo.<br />\r\n<br />\r\nQua những lời kể của nạn nh&acirc;n bị quấy rối t&igrave;nh dục ở Open World, người nghe thấy sởn da g&agrave; v&igrave; những tr&ograve; đồi bại của &ldquo;vị&rdquo; CEO n&agrave;y. Với một nữ thực tập sinh mới đến tuyển dụng, c&ocirc; b&eacute; ở lứa tuổi học sinh bị y&ecirc;u cầu thay đồ ngay trước mặt người đ&agrave;n &ocirc;ng n&agrave;y. &Ocirc;ng ta thậm ch&iacute; c&ograve;n bắt &eacute;p c&ocirc; phục vụ t&igrave;nh dục. Khi bị từ chối, vị CEO cho thực tập sinh n&agrave;y biết: &ldquo;Nhiều c&ocirc; g&aacute;i sẵn s&agrave;ng khỏa th&acirc;n trước mặt t&ocirc;i. C&ocirc; đang từ chối may mắn ở đ&acirc;y đấy&rdquo;.<br />\r\n<br />\r\nCơn &aacute;c mộng với một c&ocirc; g&aacute;i lần đầu đi thi audition để mơ ước trở th&agrave;nh ca sĩ chưa dừng ở đ&oacute;. Khi ra khỏi ph&ograve;ng v&agrave; đứng chờ thang m&aacute;y, &ldquo;vị&rdquo; CEO n&agrave;y tiến đến đụng chạm: &ldquo;C&ocirc; nghĩ c&ocirc; c&oacute; thể trở th&agrave;nh một ca sĩ như thế n&agrave;y sao?&rdquo; &ndash; &ocirc;ng ta n&oacute;i v&agrave; sau đ&oacute; gọi điện đến những c&ocirc;ng ty kh&aacute;c - nơi c&ocirc; g&aacute;i đăng k&yacute; thi audition, để chặn đường mơ ước của c&ocirc; b&eacute;.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Gianghp/2013_09_02/1376388743-kpop--8-.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>CEO &quot;y&ecirc;u r&acirc;u xanh&quot; Jang Suk Woo.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Trong khi đ&oacute;, những nạn nh&acirc;n kh&aacute;c c&ograve;n cung cấp c&acirc;u chuyện kinh khủng hơn về t&ecirc;n gi&aacute;m đốc &ldquo;y&ecirc;u r&acirc;u xanh&rdquo; n&agrave;y. Một c&ocirc; g&aacute;i kh&aacute;c từng l&agrave; thực tập sinh ở Open World kể lại trong nước mắt: &ldquo;Điều khiến t&ocirc;i sốc nhất ch&iacute;nh l&agrave; việc &ocirc;ng ta lạm dụng t&igrave;nh dục một c&ocirc; b&eacute; mới chỉ học lớp 6. T&ocirc;i đ&atilde; rất cho&aacute;ng v&aacute;ng khi thấy những tấm ảnh nude &ocirc;ng ta chụp, vẽ của c&aacute;c thực tập sinh m&agrave; &ocirc;ng ta &eacute;p họ cởi đồ rồi hứa sẽ đưa họ l&ecirc;n th&agrave;nh ng&ocirc;i sao. &Ocirc;ng ta lợi dụng vị tr&iacute; của m&igrave;nh để lừa dối những đứa trẻ&rdquo;.<br />\r\n<br />\r\nTheo b&aacute;o c&aacute;o của cảnh s&aacute;t Kangnam, Jang Suk Woo đ&atilde; lạm dụng t&igrave;nh dục với hơn 10 nữ học vi&ecirc;n kể từ năm 2008. &Ocirc;ng n&agrave;y thường xuy&ecirc;n bỏ thuốc k&iacute;ch dục v&agrave;o đồ uống của họ để thực hiện h&agrave;nh vi cưỡng hiếp. Kh&ocirc;ng những thế, Jang c&ograve;n ra lệnh cho c&aacute;c th&agrave;nh vi&ecirc;n nh&oacute;m nhạc kh&aacute;c cưỡng d&acirc;m để ghi h&igrave;nh như một th&uacute; vui trụy lạc.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Gianghp/2013_09_02/1376388743-kpop--7-.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Một loạt những ph&oacute;ng sự, clip ghi lại lời kể từ c&aacute;c nạn nh&acirc;n li&ecirc;n quan trực tiếp v&agrave; gi&aacute;n tiếp tới vụ scandal cưỡng hiếp của Jang Suk Won đ&atilde; b&oacute;c trần sự thật đen tối đằng sau &aacute;nh h&agrave;o quang lung linh của Kpop</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Khi một loạt những nạn nh&acirc;n đ&atilde; đứng ra l&agrave;m chứng, cuối c&ugrave;ng th&aacute;ng 7/2012, Jang Suk Woo bị kết &aacute;n 9 năm t&ugrave; giam. Bản kh&aacute;ng c&aacute;o sau đ&oacute; của hắn ta đ&atilde; kh&ocirc;ng được chấp thuận.<br />\r\n<br />\r\nC&acirc;u chuyện của Jang Suk Woo tưởng sẽ l&agrave; b&agrave;i học cho những &ocirc;ng lớn của ng&agrave;nh giải tr&iacute; H&agrave;n. Nhưng cuối th&aacute;ng 2 năm nay, cảnh s&aacute;t Seoul tiếp tục phải điều tra một CEO trẻ 29 tuổi v&igrave; tội tấn c&ocirc;ng t&igrave;nh dục 30 học vi&ecirc;n trẻ. Đa số nạn nh&acirc;n l&agrave; những c&ocirc; g&aacute;i trẻ, xinh đẹp, mới gia nhập hoặc đang trong thời kỳ thực tập sinh để nu&ocirc;i giấc mộng nổi tiếng.<br />\r\n<br />\r\nĐ&uacute;ng như lời c&ocirc; g&aacute;i thực tập sinh của c&ocirc;ng ty Open World từng nhấn mạnh, việc lạm dụng t&igrave;nh dục c&oacute; thể t&igrave;m thấy ở 8/10 c&ocirc;ng ty giải tr&iacute; xứ H&agrave;n.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Gianghp/2013_09_02/1376388743-kpop--5-.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Việc lạm dụng t&igrave;nh dục c&oacute; thể t&igrave;m thấy ở 8/10 c&ocirc;ng ty giải tr&iacute; xứ H&agrave;n, một thực tập sinh c&ocirc;ng ty giải tr&iacute; Open World nhấn mạnh.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Giấc mơ người nổi tiếng biến thực tập sinh th&agrave;nh &ldquo;g&aacute;i b&aacute;n hoa&rdquo;</strong><br />\r\n<br />\r\nNhững dẫn chứng cụ thể khiến người ta kh&ocirc;ng khỏi sửng sốt v&agrave; x&oacute;t xa.<br />\r\n<br />\r\nNăm 2010 Ủy ban Nh&acirc;n quyền H&agrave;n Quốc c&ocirc;ng bố khảo s&aacute;t cho thấy trong số 111 nữ diễn vi&ecirc;n đ&atilde; v&agrave;o nghề v&agrave; 240 người mới nổi được hỏi, c&oacute; tới 60% thừa nhận đ&atilde; phải hiến th&acirc;n cho những nh&acirc;n vật c&oacute; quyền lực trong ng&agrave;nh giải tr&iacute;.<br />\r\n<br />\r\nVụ cưỡng hiếp của CEO c&ocirc;ng ty giải tr&iacute; Open World đ&atilde; diễn ra từ năm 2008, nhưng phải đến năm 2012 mới bị phanh phui. Suốt trong một thời gian d&agrave;i, kh&ocirc;ng ai trong số 11 nạn nh&acirc;n l&ecirc;n tiếng đ&ograve;i c&ocirc;ng l&yacute;.<br />\r\n<br />\r\nTrong cuộc phỏng vấn một nữ diễn vi&ecirc;n H&agrave;n Quốc v&agrave;o th&aacute;ng 4/2012, những c&acirc;u chuyện chỉ c&oacute; người trong nghề mới biết lần đầu được tiết lộ. Trong showbiz H&agrave;n tồn tại đường d&acirc;y g&aacute;i gọi chuy&ecirc;n nghiệp, đại gia sẵn s&agrave;ng trả 300 triệu won (khoảng 5,8 tỷ VND) trong 6 th&aacute;ng như một h&igrave;nh thức chọn g&aacute;i bao cao cấp l&agrave; người nổi tiếng. Thậm ch&iacute; nếu &ldquo;hợp đồng&rdquo; n&agrave;y được k&yacute;, một chiếc xe tiền tỷ sẽ được trao tay, coi như qu&agrave; tặng đ&iacute;nh k&egrave;m. Với số tiền n&agrave;y, đại gia sẽ được qua đ&ecirc;m 1, 2 lần trong th&aacute;ng với Người Nổi Tiếng.<br />\r\n<br />\r\nCuối th&aacute;ng 3 năm nay, một chương tr&igrave;nh ph&oacute;ng sự đặc biệt cũng đ&atilde; vạch trần thực tế về việc thực tập sinh tại nhiều c&ocirc;ng ty giải tr&iacute; H&agrave;n Quốc trở th&agrave;nh &ldquo;g&aacute;i b&aacute;n hoa&rdquo;.&hellip;<br />\r\n<br />\r\nNhững v&iacute; dụ v&agrave; con số kể tr&ecirc;n c&ugrave;ng n&oacute;i l&ecirc;n sự thật giấc mơ nổi tiếng đ&atilde; khiến những c&ocirc; g&aacute;i thực tập sinh v&agrave; những ng&ocirc;i sao bị r&agrave;ng buộc bởi những bản hợp đồng n&ocirc; lệ t&igrave;nh dục.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Gianghp/2013_09_02/1376388743-kpop--4-.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Giấc mơ Người Nổi Tiếng đ&atilde; biến những c&ocirc; g&aacute;i thực tập sinh v&agrave; những ng&ocirc;i sao bị r&agrave;ng buộc bởi những bản hợp đồng n&ocirc; lệ t&igrave;nh dục.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>C&aacute;c c&ocirc; g&aacute;i trẻ đến với c&aacute;c l&ograve; đ&agrave;o tạo ng&ocirc;i sao với ước mơ trở th&agrave;nh Người Nổi Tiếng. Tuy rằng tỷ lệ th&agrave;nh c&ocirc;ng rất &iacute;t nhưng ng&agrave;y c&agrave;ng nhiều người vẫn đổ x&ocirc; v&agrave;o c&aacute;c c&ocirc;ng ty giải tr&iacute; như con thi&ecirc;u th&acirc;n. Cũng ch&iacute;nh ước mơ đ&oacute; đ&atilde; khiến họ bị quản l&yacute; lợi dụng nhưng kh&ocirc;ng d&aacute;m c&ocirc;ng khai sự thật m&igrave;nh bị l&agrave;m nhục.<br />\r\n<br />\r\nThực tế l&agrave; khi bước ch&acirc;n v&agrave;o một c&ocirc;ng ty giải tr&iacute;, một c&ocirc; g&aacute;i muốn trở th&agrave;nh thực tập sinh ngo&agrave;i số tiền nộp theo quy định l&agrave; một quy ước ngầm về việc đổi t&igrave;nh lấy danh. Nhiều người đ&atilde; kh&ocirc;ng cưỡng lại được c&aacute;m dỗ của việc nổi tiếng, chấp nhận b&aacute;n m&igrave;nh để trở th&agrave;nh g&aacute;i hầu rượu, qua đ&ecirc;m với những &ocirc;ng chủ lớn.<br />\r\n<br />\r\nMột nh&acirc;n vật từng l&agrave;m quản l&yacute; cho nhiều ng&ocirc;i sao trẻ phản &aacute;nh sự thật: &ldquo;Nhiều người kh&ocirc;ng nhận thức r&otilde; được việc họ l&agrave; diễn vi&ecirc;n th&igrave; phải diễn, l&agrave; ca sĩ th&igrave; phải h&aacute;t để sống. Tr&ecirc;n thực tế c&oacute; rất nhiều học viện &acirc;m nhạc, học viện diễn xuất nhưng chẳng c&oacute; ai dạy dỗ c&aacute;c học tr&ograve; rằng họ phải nhận thức về nghề nghiệp của m&igrave;nh. Đ&aacute;ng tiếc l&agrave; c&oacute; nhiều trường hợp v&igrave; tham vọng th&agrave;nh Người Nổi Tiếng đ&atilde; c&oacute; những lựa chọn sai lầm. Ch&iacute;nh việc thiếu &yacute; thức về nghề nghiệp l&agrave; nguy&ecirc;n nh&acirc;n lớn nhất trong những trường hợp n&agrave;y. Người nghệ sĩ, họ cần phải biết từ chối thẳng thừng những y&ecirc;u cầu tr&aacute;i với t&acirc;m niệm của bản th&acirc;n&rdquo;.<br />\r\n<br />\r\nNếu kh&ocirc;ng tr&acirc;n trọng nh&acirc;n phẩm, đạo đức, chắc chắn sẽ c&ograve;n xảy ra nhiều những vụ việc cưỡng bức t&igrave;nh dục hay những đường d&acirc;y g&aacute;i gọi cao cấp trong Kpop n&oacute;i ri&ecirc;ng v&agrave; showbiz H&agrave;n n&oacute;i chung. Ngo&agrave;i việc siết chặt quản l&yacute; c&aacute;c c&ocirc;ng ty giải tr&iacute; m&agrave; hiện nay cảnh s&aacute;t Seoul đang tiến h&agrave;nh th&igrave; việc n&acirc;ng cao &yacute; thức đạo đức nghề nghiệp cũng cần được đẩy mạnh trong c&aacute;c học viện &acirc;m nhạc, diễn xuất.</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo Kh&aacute;m ph&aacute;</p>','Không ít những cô gái trẻ ước mơ trở thành ngôi sao Kpop đã bị ràng buộc với hợp đồng “nô lệ tình dục”.','Nhung-no-le-tinh-duc-trong-lang-nhac-Han',0,0,0,0,0,'','','',''),(5,'2013-09-04 18:01:19','2013-09-04 18:01:19',6,1,1,'Những ca khúc giúp nhóm nhạc Kpop đổi đời','<p><strong>Gee&quot; - SNSD</strong></p>\r\n\r\n<p>Được mệnh danh l&agrave; phi&ecirc;n bản nữ của Super Junior nhưng SNSD ra mắt kh&ocirc;ng th&agrave;nh c&ocirc;ng như mong đợi. Sau đ&oacute;, danh tiếng v&agrave; chỗ đứng của nh&oacute;m li&ecirc;n tục đi xuống v&igrave; c&oacute; qu&aacute; nhiều scandal xảy ra.</p>\r\n\r\n<p>Ở thời điểm đ&oacute;, SM đ&atilde; quyết định &quot;d&igrave;m h&agrave;ng&quot; SNSD, chỉ đến khi Wonder Girls Mỹ tiến v&agrave; thị trường Kpop bị bỏ ngỏ, c&ocirc;ng ty n&agrave;y mới cho &quot;con cưng&quot; t&aacute;i xuất với bản hit <em>Gee. </em>Sau khi ra mắt, b&agrave;i h&aacute;t n&agrave;y đ&atilde; &quot;oanh tạc&quot; c&aacute;c bảng xếp hạng lớn nhỏ của Kpop v&agrave; chiếm giữ vị tr&iacute; số 1 trong suốt 9 tuần li&ecirc;n tiếp tại chương tr&igrave;nh Music Bank của đ&agrave;i KBS.</p>\r\n\r\n<p>Thừa thắng x&ocirc;ng l&ecirc;n, SNSD li&ecirc;n tục t&aacute;i xuất với <em>Geine - Tell Me Your Wish, Oh, Run Devil Run, Hoot&hellip;</em> v&agrave; mới đ&acirc;y nhất l&agrave; <em>I Got A Boy</em>. Kh&ocirc;ng chỉ mang giai điệu bắt tai, cuốn h&uacute;t, những ca kh&uacute;c n&agrave;y c&ograve;n được đầu tư mạnh về h&igrave;nh ảnh, quảng b&aacute;. Nhờ đ&oacute;, SNSD ng&agrave;y c&agrave;ng c&oacute; sức ảnh hưởng lớn tại H&agrave;n Quốc, nh&oacute;m hiện được xem như girl group số 1 tại đất nước n&agrave;y.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_08_31/SNSD%20-%20Gee.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&quot;Sorry Sorry&quot; - Super Junior</strong></p>\r\n\r\n<p>Ra mắt v&agrave;o năm 2005, trong suốt 4 năm đầu, Super Junior chỉ ph&aacute;t triển đều đều, kh&ocirc;ng thể b&ugrave;ng nổ tại l&agrave;ng nhạc xứ của s&acirc;m. Đến khi ph&aacute;t h&agrave;nh ca kh&uacute;c <em>Sorry Sorry,</em> &quot;bộ sậu&quot; n&agrave;y mới thức sự khuấy động cả l&agrave;ng nhạc.</p>\r\n\r\n<p>Với <em>Sorry Sorry, </em>sự nổi tiếng của Super Junior kh&ocirc;ng c&ograve;n g&oacute;i gọn trong thị trường nước nh&agrave; m&agrave; lan sang khắp c&aacute;c nước trong khu vực v&agrave; tạo n&ecirc;n cơn sốt cover vũ đạo.</p>\r\n\r\n<p>Kh&ocirc;ng chỉ biến Super Junior trở th&agrave;nh đối thủ đ&aacute;ng gờm của mọi nh&oacute;m nhạc, <em>Sorry Sorry </em>c&ograve;n gi&uacute;p SuJu lọt v&agrave;o top năm nh&oacute;m nhạc sở hữu lượng fan lớn nhất H&agrave;n Quốc thời điểm đ&oacute;. Những ca kh&uacute;c sau n&agrave;y của &quot;con cưng&quot; nh&agrave; SM l&agrave; <em>It&#39;s You, Mr. Simple, Free, Sexy And Single&hellip; </em>đều đạt th&agrave;nh t&iacute;ch khủng với vị tr&iacute; cao ngất ngưởng tr&ecirc;n c&aacute;c bảng xếp hạng.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_08_31/Sorry%20Sorry%20_%20Super%20Junior.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>&quot;Mister&quot; - KARA</strong></p>\r\n\r\n<p>Ra mắt năm 2007, c&ugrave;ng thời điểm với Wonder Girls v&agrave; SNSD nhưng th&agrave;nh c&ocirc;ng lại đến với KARA muộn hơn hẳn 2 nh&oacute;m nhạc tr&ecirc;n. Trong khi Wonder Girls g&acirc;y b&atilde;o với li&ecirc;n ho&agrave;n hit <em>So Hot, Nobody, Tell Me,</em> SNSD th&agrave;nh c&ocirc;ng rực rỡ với <em>Gee, Tell Me Your Wish, </em>th&igrave; KARA vẫn phải sống trong cảnh &quot;hữu danh v&ocirc; thực&quot;.</p>\r\n\r\n<p>Kh&ocirc;ng chịu l&eacute;p vế, KARA quyết t&acirc;m thay đổi h&igrave;nh tượng, c&aacute;c c&ocirc; g&aacute;i rũ bỏ ho&agrave;n to&agrave;n phong c&aacute;ch nh&iacute; nhảnh, trong s&aacute;ng để trở n&ecirc;n quyến rũ hơn trong album vol.2, đặc biệt l&agrave; ca kh&uacute;c <em>Mister.</em> Với &acirc;m thanh dồn dập, mạnh mẽ, &quot;g&acirc;y nghiện&quot; v&agrave; m&agrave;n vũ đạo lắc h&ocirc;ng v&ocirc; c&ugrave;ng gợi cảm, b&agrave;i h&aacute;t đ&atilde; đưa t&ecirc;n tuổi của KARA phủ s&oacute;ng khắp mọi nơi tại xứ sở kim chi v&agrave; gi&uacute;p nh&oacute;m thăng hạng, s&aacute;nh ngang với Wonder Girls v&agrave; SNSD.</p>\r\n\r\n<p>Sau th&agrave;nh c&ocirc;ng với <em>Mister,</em> KARA nhanh ch&oacute;ng tiến qu&acirc;n sang Nhật. Bất ngờ, tại đất nước hoa anh đ&agrave;o, nh&oacute;m đ&atilde; c&oacute; những th&agrave;nh t&iacute;ch khiến nhiều người phải cho&aacute;ng v&aacute;ng, đ&acirc;y l&agrave; vũ kh&iacute; lợi hại gi&uacute;p 5 c&ocirc; g&aacute;i củng cố th&ecirc;m vị tr&iacute; của m&igrave;nh trong d&agrave;n idol nữ tại Kpop.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_08_31/Mister%20-%20KARA.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&quot;Alone&quot; - Sistar</strong></p>\r\n\r\n<p>Sistar đ&atilde; thu về nhiều th&agrave;nh t&iacute;ch đ&aacute;ng nể sau khi ra mắt với <em>Push Push</em> sau đ&oacute; l&agrave; <em>How Dare You, So Cool... </em>Thế nhưng, th&agrave;nh c&ocirc;ng đ&oacute; kh&ocirc;ng đủ để Sistar cạnh tranh với những đối thủ qu&aacute; mạnh như Wonder Girls, SNSD, 2NE1, f(x) hay MissA.... Tuy vậy, bằng sự cố gắng v&agrave; giọng h&aacute;t ho&agrave;n hảo, đặc biệt l&agrave; th&agrave;nh c&ocirc;ng của bản hit <em>Alone</em>, Sistar đ&atilde; trở th&agrave;nh một trong những nh&oacute;m nhạc nữ quyền lực nhất H&agrave;n Quốc.</p>\r\n\r\n<p><em>Give It To Me -</em> ca kh&uacute;c được ph&aacute;t h&agrave;nh gần đ&acirc;y nhất của Sistar đ&atilde; một lần nữa khẳng định vị thế của 4 c&ocirc; g&aacute;i. Thậm ch&iacute;, b&agrave;i h&aacute;t c&ograve;n vượt mặt &quot;đ&agrave;n anh&quot; <em>Alone</em> khi n&oacute; thống trị to&agrave;n bộ c&aacute;c bảng xếp hạng &acirc;m nhạc, kể cả iChart của Instiz chỉ &iacute;t giờ sau khi ph&aacute;t h&agrave;nh.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_08_31/sistar_alone.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>&quot;Nillili Mambo&quot; - BlockB</strong></p>\r\n\r\n<p>Nhắc tới BlockB, chắc chắn nhiều người sẽ nghĩ ngay tới scandal diễn ra v&agrave;o năm 2012. Ở thời điểm đ&oacute;, nh&oacute;m đ&atilde; bị kh&aacute;n giả cả nước tẩy chay, chỉ tr&iacute;ch v&agrave; y&ecirc;u cầu giải t&aacute;n. Điều n&agrave;y đ&atilde; khiến Block B gần như bị &quot;cấm vận&quot;, đ&igrave;nh trệ trong mọi hoạt động v&agrave; đ&agrave;nh lui về ở ẩn suốt một thời gian d&agrave;i. Trong t&igrave;nh huống đ&oacute;, những tưởng nh&oacute;m sẽ thực sự biến mất tr&ecirc;n bản đồ Kpop, thế nhưng nh&oacute;m đ&atilde; trở lại một c&aacute;ch mạnh mẽ với MV mang t&ecirc;n <em>Nililli mambo.</em></p>\r\n\r\n<p>Tr&ecirc;n nền nhạc hip hop bắt tai, từng lời ca của <em>Nililli Mambo</em> vang l&ecirc;n như sự đ&aacute;p trả của BlockB tới anti-fan v&agrave; thể hiện c&aacute; t&iacute;nh ri&ecirc;ng trong mỗi th&agrave;nh vi&ecirc;n: &quot;Những thằng nh&oacute;c gan lỳ đ&atilde; trở lại. Sự ngạc nhi&ecirc;n v&agrave; run sợ của mọi người. D&ugrave; ngươi c&oacute; mạnh cỡ n&agrave;o cũng chẳng l&agrave; g&igrave; đ&acirc;u&hellip;&quot;.</p>\r\n\r\n<p>Với sự độc đ&aacute;o từ giai điệu, bối cảnh MV, h&igrave;nh tượng cho tới ca từ, <em>Nililli Mambo </em>đ&atilde; nhanh ch&oacute;ng thu phục kh&aacute;n giả. Ca kh&uacute;c kh&ocirc;ng chỉ cạnh tranh khốc liệt với h&agrave;ng loạt đ&agrave;n anh như DBSK, U.Kiss, CNBLUE&hellip; tr&ecirc;n c&aacute;c bảng xếp hạng m&agrave; c&ograve;n gi&uacute;p BlockB gom về tr&ecirc;n 10.000 fan v&agrave; vươn l&ecirc;n vị tr&iacute; thứ 17 tr&ecirc;n bảng xếp hạng Daum Caf&eacute; tại thời điểm <em>Nililli Mambo </em>ph&aacute;t h&agrave;nh.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_08_31/Nillili%20mambo%20-%20BlockB.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Lan Phương</p>\r\n\r\n<p>Theo Tri Thức</p>','KARA, Super Junior, SNSD, Sistar... đều không được nhiều người chú ý vào thời gian đầu, nhưng nhờ một bản hit, họ đã trở nên nổi tiếng tại Hàn Quốc và nhiều quốc gia khác.','Nhung-ca-khuc-giup-nhom-nhac-Kpop-doi-doi',0,0,0,0,0,'','','',''),(6,'2013-09-04 18:02:37','2013-09-04 18:02:37',7,1,1,'Revo HD4 hút khách không chỉ vì giá rẻ','<div class=\"content\">\r\n<p>Nhiều người d&ugrave;ng đ&ocirc;i khi cũng l&uacute;ng t&uacute;ng khi đưa ra l&yacute; do cho lựa chọn của m&igrave;nh. Với hơn 4 triệu đồng, để mua một smartphone c&oacute; kh&aacute; nhiều phương &aacute;n, nhưng Revo HD4 vẫn l&agrave; lựa chọn h&agrave;ng đầu trong suốt thời gian qua.</p>\r\n\r\n<p>Gặp chị Thanh (nh&acirc;n vi&ecirc;n ng&acirc;n h&agrave;ng BIDV) tại showroom ở 281A Kh&acirc;m Thi&ecirc;n- H&agrave; Nội trong t&acirc;m trạng h&aacute;o hức mới mua được chiếc Revo HD4, chị cho biết: &ldquo;M&igrave;nh tham khảo cũng thấy c&oacute; kh&aacute; nhiều mẫu trong tầm gi&aacute; 4-5 triệu, nhưng thấy chiếc smartphone n&agrave;y c&oacute; m&agrave;n h&igrave;nh v&agrave; camera đẹp hơn hẳn n&ecirc;n m&igrave;nh đ&atilde; quyết định mua&rdquo;.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV2_G3/2013_09_03/image001_2.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Revo HD4 l&agrave; smartphone đ&aacute;ng mua ở tầm gi&aacute; dưới 5 triệu đồng.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Cũng giống như chị Thanh, rất nhiều kh&aacute;ch h&agrave;ng khi đến mua d&ograve;ng điện thoại n&agrave;y đều c&oacute; chia sẻ tương tự. Quả thật trong bối cảnh kinh tế kh&oacute; khăn như hiện nay, người d&ugrave;ng lu&ocirc;n phải thắt chặt chi ti&ecirc;u, v&igrave; thế ai cũng c&acirc;n nhắc rất kỹ lưỡng để chọn cho m&igrave;nh sản phẩm &ldquo;đ&aacute;ng đồng tiền b&aacute;t gạo&rdquo;. Anh Quyết Tiến (kỹ sư x&acirc;y dựng) cho hay: &ldquo;Trước đ&acirc;y m&igrave;nh cứ nghĩ nếu muốn c&oacute; chiếc smartphone đ&aacute;p ứng đầy đủ t&iacute;nh năng như m&igrave;nh mong muốn th&igrave; phải bỏ ra kh&ocirc;ng dưới 10 triệu đồng. Nhưng mới đ&acirc;y được bạn b&egrave; giới thiệu, m&igrave;nh t&igrave;m hiểu v&agrave; thực sự bất ngờ về chất lượng sản phẩm v&agrave; mức gi&aacute; qu&aacute; tốt của HKPhone. Giờ m&igrave;nh đ&atilde; c&oacute; thể thoải m&aacute;i xem phim, nghe nhạc, chơi game, lướt web...với chiếc Revo HD4 gi&aacute; chỉ 4,3 triệu đồng&rdquo;.</p>\r\n\r\n<p>D&ograve;ng điện thoại n&agrave;y được trang bị c&ocirc;ng nghệ chip l&otilde;i tứ 1,2GHz cho tốc độ xử l&yacute; nhanh, khả năng chạy đa t&aacute;c vụ rất tốt mang đến hiệu quả sử dụng cao nhất cho người d&ugrave;ng. M&aacute;y sở hữu m&agrave;n h&igrave;nh cảm ứng k&iacute;ch thước 5 inch với độ ph&acirc;n giải HD1280x720 pixel v&agrave; tấm nền IPS cao cấp đem đến khả năng hiển thị sắc n&eacute;t, sống động v&agrave; rực rỡ.</p>\r\n\r\n<p>Ngo&agrave;i ra, mẫu h&agrave;ng n&agrave;y c&ograve;n c&oacute; camera 8 MPx, camera sau 3 MPx với c&ocirc;ng nghệ độc quyền HDLens của h&atilde;ng, khả năng quay video full HD 1080p gi&uacute;p lưu lại những h&igrave;nh ảnh c&oacute; độ n&eacute;t, ch&acirc;n thực v&agrave; đẹp hơn hẳn c&aacute;c thế hệ smartphone th&ocirc;ng thường. Dung lượng pin của m&aacute;y cũng rất cao ở mức 2500 mAh. M&aacute;y sử dụng hệ điều h&agrave;nh Android Jelly Bean 4.2.1, gi&uacute;p tận dụng tối đa sức mạnh phần cứng tr&ecirc;n sản phẩm.</p>\r\n\r\n<div>\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV2_G3/2013_09_03/image002_1.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nhiều kh&aacute;ch h&agrave;ng y&ecirc;u th&iacute;ch Revo HD4 ngay sau khi cầm m&aacute;y.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div>Chị Hoa, nh&acirc;n vi&ecirc;n văn ph&ograve;ng, chia sẻ quan điểm: &ldquo;Nếu bỏ ra một khoản tiền dưới 500.000 đồng để mua 1 chiếc điện thoại th&igrave; bạn đang mua một chiếc điện thoại chỉ để nghe gọi. Nhưng nếu bỏ ra gần 20 triệu để mua một chiếc điện thoại th&igrave; điều đ&oacute; lại c&oacute; nghĩa l&agrave; bạn mua cho m&igrave;nh một m&oacute;n đồ trang sức rất đẹp v&agrave; đ&aacute;ng gi&aacute;. Với m&igrave;nh, khi quyết định mua khi một c&aacute;i g&igrave; đ&oacute; m&igrave;nh phải thấy n&oacute; thật sự n&oacute; đẹp, c&oacute; gi&aacute; trị v&agrave; hợp t&uacute;i tiền. V&agrave; với gi&aacute; chỉ 4,3 triệu, Revo HD4 quả thực l&agrave; chiếc smartphone đ&aacute;ng mua trong tầm gi&aacute; b&igrave;nh d&acirc;n&rdquo;.</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>Gi&aacute; 4,3 triệu th&ocirc;i chưa đủ thuyết phục người ti&ecirc;u d&ugrave;ng quyết định mua d&ograve;ng điện thoại n&agrave;y, m&agrave; sản phẩm đ&oacute; phải được đầu tư kỹ lưỡng cả về chất lượng gia c&ocirc;ng, trang bị cấu h&igrave;nh vượt trội v&agrave; khả năng đ&aacute;p ứng rất tốt nhu cầu giải tr&iacute;, c&ocirc;ng việc.\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV2_G3/2013_09_03/image003_1.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Revo HD4 c&oacute; thể l&agrave; m&oacute;n đồ trang sức sang trọng, s&agrave;nh điệu.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<p>Mức gi&aacute; thấp kỷ lục 4,3 triệu đồng khiến d&ograve;ng điện thoại n&agrave;y trở th&agrave;nh smartphone l&otilde;i tứ m&agrave;n h&igrave;nh HD gi&aacute; rẻ nhất Việt Nam. Tuy nhi&ecirc;n, điều hấp dẫn nhất ở sản phẩm n&agrave;y xuất ph&aacute;t từ ch&iacute;nh chất lượng vượt trội của mẫu n&agrave;y so với c&aacute;c sản phẩm kh&aacute;c c&ugrave;ng ph&acirc;n kh&uacute;c tr&ecirc;n thị trường. Revo HD4 hiện được b&aacute;n tại <a href=\"http://hkphone.com.vn/store.html\" target=\"_blank\">120 showroom ch&iacute;nh h&atilde;ng </a>của HKPhone tr&ecirc;n to&agrave;n quốc c&ugrave;ng với c&aacute;c cam kết <em>100% H&agrave;i l&ograve;ng</em> v&agrave; <em>Sản phẩm ch&iacute;nh h&atilde;ng rẻ nhất Việt Nam</em>. Khi mua m&aacute;y kh&aacute;ch h&agrave;ng c&ograve;n được tặng k&egrave;m 1 ốp lưng cao cấp 200.000 đồng, tấm d&aacute;n m&agrave;n h&igrave;nh chống v&acirc;n tay 100.000 đồng, bộ game, ứng dụng bản quyền 200.000 đồng v&agrave; 1 cuốn ấn phẩm smartphone.</p>\r\n\r\n<p>Xem th&ocirc;ng tin về Revo HD4 v&agrave; c&aacute;c ch&iacute;nh s&aacute;ch ưu đ&atilde;i HKPhone d&agrave;nh cho kh&aacute;ch h&agrave;ng<a href=\"http://hkphone.com.vn/\" target=\"_blank\"> tại đ&acirc;y.</a></p>\r\n\r\n<p><img alt=\"\" src=\"http://stats.ad.zing.vn/piwik.php?idsite=17&amp;rec=1\" style=\"height:1px; width:1px\" />Tư liệu: HKPhone</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo Tri Thức</p>','Trong bối cảnh kinh tế khó khăn, người dùng luôn phải thắt chặt chi tiêu, vì thế ai cũng cân nhắc rất kỹ lưỡng để chọn cho mình sản phẩm “đáng đồng tiền bát gạo”.','Revo-HD4-hut-khach-khong-chi-vi-gia-re',0,0,0,0,0,'','','',''),(7,'2013-09-04 18:03:57','2013-09-04 18:03:57',8,1,1,'Hộp đựng iPhone 5C trong suốt giống iPod Touch','<div class=\"summary\">\r\n<p>H&igrave;nh ảnh r&ograve; rỉ mới nhất cho thấy smartphone gi&aacute; rẻ của Apple c&oacute; hộp đựng &quot;kh&ocirc;ng đến nỗi tệ&quot; như những ảnh chụp v&agrave; m&ocirc; h&igrave;nh truớc đ&acirc;y.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<p>H&igrave;nh ảnh mới nhất tr&ecirc;n trang <em>iapps.im</em> cho thấy, một l&ocirc; h&agrave;ng iPhone 5C tại Trung Quốc được đ&oacute;ng hộp nhựa trong suốt. Một số tin đồn trước đ&oacute; cho biết, sản phẩm d&ugrave;ng hộp nhựa trắng bằng giấy.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/tinnd/2013_09_02/iphone5c-lead-1378125996_copy.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Một chiếc iPhone 5C m&agrave;u xanh</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/tinnd/2013_09_02/iphone5c-bunch_copy.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Vỏ hộp bằng nhựa trong suốt</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/tinnd/2013_09_02/iphone5c-pink-lead_copy.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Một l&ocirc; iPhone 5C m&agrave;u hồng</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Theo<em>Engadget</em>, hiện tại những h&igrave;nh ảnh n&agrave;y đ&atilde; bị x&oacute;a khỏi trang <em>iapps.im</em> do y&ecirc;u cầu của &quot;một b&ecirc;n c&oacute; li&ecirc;n quan&quot;. Nhưng c&aacute;c trang c&ocirc;ng nghệ kh&aacute;c đ&atilde; nhanh ch&oacute;ng đăng tải lại.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>M&ocirc; h&igrave;nh iPhone 5C xuất hiện ở TP HCM c&aacute;ch đ&acirc;y một tuần&nbsp;</em></p>\r\n\r\n<p>Nếu những h&igrave;nh ảnh tr&ecirc;n l&agrave; thực, c&oacute; thể chiếc iPhone 5C tr&ocirc;ng sẽ thanh lịch v&agrave; bắt mắt hơn so với những h&igrave;nh ảnh v&agrave; m&ocirc; h&igrave;nh r&ograve; rỉ trước đ&acirc;y.&nbsp;</p>\r\n</div>\r\n\r\n<p>Duy T&iacute;n</p>','Hình ảnh rò rỉ mới nhất cho thấy smartphone giá rẻ của Apple có hộp đựng \"không đến nỗi tệ\" như những ảnh chụp và mô hình truớc đây.','Hop-dung-iPhone-5C-trong-suot-giong-iPod-Touch',0,0,0,0,0,'','','',''),(8,'2013-09-04 18:05:50','2013-09-05 10:00:43',9,1,1,'HP ra mắt máy tính để bàn có kết nối Wi-Fi','<div class=\"content\">\r\n<p><strong>Kết nối Wi-Fi, tốc độ xử l&yacute; nhanh, tiết kiệm điện năng tối đa cho doanh nghiệp</strong></p>\r\n\r\n<p>HP l&agrave; nh&agrave; sản xuất đầu ti&ecirc;n cho ra đời những chiếc m&aacute;y t&iacute;nh để b&agrave;n c&oacute; kết nối Wi-Fi gi&uacute;p người d&ugrave;ng tiện dụng hơn trong xu thế kết nối kh&ocirc;ng d&acirc;y hiện nay. PC Pavilion 500 thế hệ mới c&ograve;n được được n&acirc;ng cấp l&ecirc;n thế hệ vi xử l&yacute; thứ 3 tr&ecirc;n nền tảng c&ocirc;ng nghệ Ivy Bridge thay cho Sandy Bridge ở thế hệ trước đ&acirc;y. Đồng thời một số model cao cấp c&ograve;n được trang bị cấu h&igrave;nh Core i5 kết hợp với card đồ họa rời gi&uacute;p cho m&aacute;yc&oacute; tốc độ xử l&yacute; đ&aacute;ng kinh ngạc.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV1_G3/2013_08_29/hp500.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>HP Pavilion 500 c&oacute; thiết kế gọn nhẹ, cứng c&aacute;p với khung bo viền quanh ph&iacute;a trước m&aacute;y.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Khả năng tiết kiệm điện cũng l&agrave; điểm đ&aacute;ng ch&uacute; &yacute; của d&ograve;ng sản phẩm n&agrave;y. Đạt 2 ti&ecirc;u chuẩn Epeat (th&acirc;n thiện với m&ocirc;i trường) v&agrave; Energy star (tiết kiệm điện), chiếc m&aacute;y để b&agrave;n n&agrave;y cũng l&agrave; ứng cử vi&ecirc;n h&agrave;ng đầu trong số những m&aacute;y PC c&oacute; khả năng tiết kiệm điện năng cao gi&uacute;p hạ thấp chi ph&iacute; sử dụng điện cho gia đ&igrave;nh cũng như doanh nghiệp sử dụng.</p>\r\n\r\n<p><strong>Tối ưu h&oacute;a nhu cầu sử dụng, ti&ecirc;u thụ điện năng thấp nhất trong c&aacute;c d&ograve;ng PC</strong></p>\r\n\r\n<p>B&ecirc;n cạnh d&ograve;ng PC kết nối th&ocirc;ng minh Pavilion 500, HP c&ograve;n giới thiệu bản n&acirc;ng cấp Pavilion P2 với t&ecirc;n gọi Pavilion 110 sử dụng chip thế hệ mới nhưng vẫn thừa kế được những t&iacute;nh năng nổi trội từ thế hệ trước.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV1_G3/2013_08_29/hp110.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>HP Pavilion 110 tiết ki&ecirc;m năng lượng v&agrave; th&acirc;n thiện với m&ocirc;i trường.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>M&aacute;y hiện c&oacute; cấu h&igrave;nh duy nhất xuất hiện tại Việt Nam với bộ xử l&yacute; cơ bản của Intel Pentium Dual Core thế hệ mới nhất tr&ecirc;n nền tảng Ivy Bridge, bộ nhớ Ram ti&ecirc;u chuẩn 2GB (c&oacute; khả năng mở rộng l&ecirc;n 8GB) c&ugrave;ng ổ đĩa cứng 500GB, ổ đĩa quang chuẩn đọc ghi đa định dạng. C&aacute;c cổng cắm kết nối kh&aacute; đầy đủ kể cả cổng kết nối DVI trước đ&acirc;y thường chỉ c&oacute; ở model tầm trung.</p>\r\n\r\n<p>D&ograve;ng m&aacute;y n&agrave;y dễ l&agrave;m người d&ugrave;ng h&agrave;i l&ograve;ng bằng việc đ&aacute;p ứng tốt những nhu cầu cơ bản như truy cập ứng dụng mạng x&atilde; hội, nhận gửi email, c&aacute;c t&iacute;nh to&aacute;n t&agrave;i ch&iacute;nh c&aacute;c nh&acirc;n hay phục nhu cầu học tập cơ bản cho c&aacute;c sinh vi&ecirc;n v&agrave; đặc biệt th&iacute;ch hợp với nhu cầu mua sắm online- xu thế ti&ecirc;u d&ugrave;ng rất thịnh h&agrave;nh hiện nay.</p>\r\n\r\n<p>M&aacute;y c&oacute; lượng điện ti&ecirc;u thụ bằng một chiếc m&aacute;y laptop, mức ti&ecirc;u thụ điện thấp nhất trong c&aacute;c d&ograve;ng PC hiện nay. Để l&agrave;m được điều n&agrave;y, nh&agrave; sản xuất đ&atilde; sử dụng main board được thiết kế ri&ecirc;ng cho bộ nguồn 1 chiều DC v&agrave; nhờ bộ nguồn b&ecirc;n ngo&agrave;i adapter c&ocirc;ng suất 90W gi&uacute;p việc ti&ecirc;u thụ điện năng của m&aacute;y chỉ tương đương như một chiếc laptop.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hiện HP Pavilion 110 Series v&agrave; HP Pavilion 500 Series được ph&acirc;n phối rộng r&atilde;i tại hệ thống đại l&yacute; của FPT Distribution tr&ecirc;n to&agrave;n quốc. Tại H&agrave; Nội, Tp.HCM, Đ&agrave; Nẵng v&agrave; Cần Thơ, người d&ugrave;ng khi mua HP Pavilion sẽ được hưởng dịch vụ bảo h&agrave;nh tận nơi trong v&ograve;ng 8 tiếng kể từ l&uacute;c y&ecirc;u cầu dịch vụ. Nh&acirc;n vi&ecirc;n kỹ thuật bảo h&agrave;nh sẽ đến tận nơi kiểm tra t&igrave;nh trạng thiết bị, xử l&yacute; tại chỗ đối với những trục trặc đơn giản, hoặc lấy thiết bị mang về trung t&acirc;m xử l&yacute;. Theo th&ocirc;ng tin từ nh&agrave; ph&acirc;n phối, từ 13/9 đến 31/10/2013, người d&ugrave;ng sẽ được tặng ngay thẻ điện thoại khi mua m&aacute;y t&iacute;nh để b&agrave;n HP (HP PC) P2-1421, HP 110-021L , Pavilion P6 (bao gồm c&aacute;c model Pavilion P6-2311L , Pavilion P6-2315L , Pavilion P6-2341L), Pavilion 500 (bao gồm c&aacute;c model Pavilion 500-011l, Pavilion 500-015l, Pavilion 500-041l, Pavilion 500-040l) do FPT ph&acirc;n phối. Mọi th&ocirc;ng tin chi tiết vui l&ograve;ng li&ecirc;n hệ tại điểm b&aacute;n.</p>\r\ni ngư\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV1_G3/2013_08_29/2013-08-29_cau%20hinh.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cấu h&igrave;nh cơ bản của c&aacute;c d&ograve;ng sản phẩm Pavilion thế hệ mới 2013</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\"\" src=\"http://stats.ad.zing.vn/piwik.php?idsite=17&amp;rec=1\" style=\"height:1px; width:1px\" />Tư liệu: &nbsp;FPT Distribution</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo Tri Thức</p>','HP giới thiệu ra thị trường dòng máy tính để bàn HP PC Pavilion 500 thế hệ mới có tích hợp Wi-Fi với nhiều cải tiến thông minh.','HP-ra-mat-may-tinh-de-ban-co-ket-noi-Wi-Fi',0,0,0,0,0,'','','',''),(9,'2013-09-04 18:07:58','2013-09-04 21:58:22',10,1,1,'Minh Hằng ngồi \'ghế nóng quyền lực\'','<div class=\"summary\">\r\n<p>Nhạc sĩ Nguyễn Hải Phong, VJ nổi tiếng T&ugrave;ng Leo v&agrave; nữ ca sĩ xinh đẹp Minh Hằng sẽ ngồi v&agrave;o &lsquo;ghế n&oacute;ng&rsquo; của cuộc thi t&igrave;m kiếm &quot;Đại sứ t&agrave;i năng O&rsquo;Star 2013&quot;.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<p>Đều l&agrave; những người t&agrave;i năng trong lĩnh vực của m&igrave;nh, tự tin, bản lĩnh, v&agrave; từng gắn b&oacute; với c&aacute;c chương tr&igrave;nh d&agrave;nh cho giới trẻ, &ldquo;bộ ba quyền lực&rdquo; n&agrave;y sẽ l&agrave; những người sẽ đồng h&agrave;nh v&agrave; lựa chọn ra top 12 th&iacute; sinh xuất sắc nhất cho v&ograve;ng chung kết.</p>\r\n\r\n<p><strong>Nguyễn Hải Phong - nhạc sĩ đa t&agrave;i</strong></p>\r\n\r\n<p>Ch&agrave;ng trai sinh năm 1982 l&agrave; một c&aacute;i t&ecirc;n nổi trội trong giới nhạc sĩ trẻ Việt Nam. Bắt đầu sự nghiệp v&agrave;o năm 2007 với ca kh&uacute;c <em>Ng&acirc;y ng&ocirc;</em>&nbsp;do Lam Trường tr&igrave;nh b&agrave;y, Nguyễn Hải Phong nhanh ch&oacute;ng gặt h&aacute;i được nhiều giải thưởng v&agrave; từng bước khẳng định t&ecirc;n tuổi. Cho đến nay, anh l&agrave; một trong những lựa chọn h&agrave;ng đầu của c&aacute;c nghệ sĩ t&ecirc;n tuổi để tạo ra những sản phẩm hit thời thượng.&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV1_G3/2013_08_29/image001_copy_copy_copy_copy.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Anh từng gi&agrave;nh được giải <em>B&agrave;i h&aacute;t phong c&aacute;ch rock nổi bật</em>&nbsp;ở chương tr&igrave;nh B&agrave;i h&aacute;t Việt 2008 với ca kh&uacute;c <em>G&oacute;c tối</em>. Năm 2009, anh gi&agrave;nh được giải <em>Nhạc sĩ được y&ecirc;u th&iacute;ch</em>&nbsp;v&agrave; <em>Nhạc sĩ h&ograve;a &acirc;m xuất sắc</em>&nbsp;trong chương tr&igrave;nh L&agrave;n s&oacute;ng Xanh. Với phong c&aacute;ch trẻ trung, c&aacute;c b&agrave;i h&aacute;t của anh ở nhiều thể loại Pop, Rock đều được kh&aacute;n giả trẻ y&ecirc;u mến như&nbsp;<em>Đ&ocirc;i gi&agrave;y vải</em>, <em>Đ&ocirc;i mắt</em>, <em>Tan biến</em>, <em>Đường cong</em>, <em>Bay</em>&hellip;<br />\r\n<br />\r\nKh&ocirc;ng chỉ thu m&igrave;nh trong việc s&aacute;ng t&aacute;c, Nguyễn Hải Phong c&ograve;n l&agrave; một người rất đa t&agrave;i. Anh thể hiện rất xuất sắc c&aacute;c ca kh&uacute;c do ch&iacute;nh anh s&aacute;ng t&aacute;c - đặc biệt l&agrave; album <em>Linh hồn v&agrave; thể x&aacute;c</em> do ch&iacute;nh anh thể hiện đ&atilde; tạo được tiếng vang lớn trong giới nghệ thuật. Ngo&agrave;i ra, Nguyễn Hải Phong c&ograve;n tham gia vai tr&ograve; đạo diễn trong hai MV <em>Triệu ph&uacute;&nbsp;</em>- cho c&ocirc; học tr&ograve; Linh Phi, v&agrave; <em>Taxi</em>&nbsp;cho đ&agrave;n chị Thu Minh. Cả hai MV đều nhận được nhiều lời khen ngợi, thậm ch&iacute; đạo diễn Nguyễn Quang Dũng c&ograve;n tin tưởng giao cho anh d&agrave;n dựng c&aacute;c tiết mục trong lễ trao giải Video &acirc;m nhạc Việt Nam 2011. Nguyễn Hải Phong l&agrave; một c&aacute;i t&ecirc;n s&aacute;ng gi&aacute; trong d&ugrave; ở vai tr&ograve; nhạc sĩ hay đạo diễn trong showbiz hiện nay.&nbsp;</p>\r\n\r\n<p><strong>T&ugrave;ng Leo - Sống c&ugrave;ng người trẻ</strong></p>\r\n\r\n<p>Nếu n&oacute;i về sự thấu hiểu v&agrave; gắn b&oacute; d&agrave;nh cho giới trẻ Việt, VJ T&ugrave;ng Leo l&agrave; một trong những người c&oacute; kinh nghiệm v&agrave; d&agrave;nh được nhiều th&agrave;nh c&ocirc;ng nhất. Anh từng trải qua rất nhiều vai tr&ograve; kh&aacute;c nhau, tham gia viết b&aacute;o từ năm 2004, giảng vi&ecirc;n Đại học Kiến tr&uacute;c TP.HCM, hiện đang l&agrave; một bi&ecirc;n tập vi&ecirc;n v&agrave; MC truyền h&igrave;nh nổi tiếng, c&oacute; cả những talkshow ri&ecirc;ng như Leo&rsquo;s show hay Leo and U.&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV1_G3/2013_08_29/image003_copy_copy_copy.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Ngo&agrave;i ra, T&ugrave;ng Leo c&ograve;n l&agrave; một cư d&acirc;n mạng được y&ecirc;u th&iacute;ch. Những b&agrave;i viết của anh về giới trẻ c&oacute; lượng like v&agrave; chia sẻ rất nhiều, bởi chạm được v&agrave;o t&acirc;m tư v&agrave; t&igrave;nh cảm của họ. Tập tản văn <em>T&igrave;m nhau giữa S&agrave;i G&ograve;n</em>&nbsp;của anh ra mắt đầu năm 2013 lập tức đ&atilde; trở th&agrave;nh hiện tượng. Giới trẻ y&ecirc;u mến những trang viết gần gũi, đầy t&igrave;nh cảm m&agrave; anh d&agrave;nh cho họ.<br />\r\n<br />\r\nD&ugrave; đảm nhiệm rất nhiều vai tr&ograve;, nhưng l&uacute;c n&agrave;o T&ugrave;ng Leo cũng ho&agrave;n th&agrave;nh tốt c&ocirc;ng việc. Anh n&oacute;i rằng: &ldquo;Đ&oacute; l&agrave; nhờ đam m&ecirc; thật sự, bạn c&oacute; thể ho&agrave;n th&agrave;nh nhiều việc c&ugrave;ng l&uacute;c nhờ đam m&ecirc;. T&ocirc;i m&ecirc; đến đ&acirc;u, t&ocirc;i bươn đến đ&oacute;. Đ&atilde; c&oacute; được một ngọn lửa l&ograve;ng, phải ch&aacute;y cho bằng hết&rdquo;, v&agrave; ngọn lửa đ&oacute; anh đ&atilde; truyền cho rất nhiều bạn trẻ sống hết m&igrave;nh v&agrave; đầy cảm hứng.&nbsp;</p>\r\n\r\n<p><strong>Minh Hằng - t&agrave;i năng v&agrave; nỗ lực</strong></p>\r\n\r\n<p>Minh Hằng ch&iacute;nh l&agrave; c&aacute;i t&ecirc;n minh chứng cho những nỗ lực kh&ocirc;ng ngừng sẽ dẫn đến th&agrave;nh c&ocirc;ng. C&ocirc; g&aacute;i sinh năm 1987 bước ch&acirc;n v&agrave;o nghệ thuật từ khi mới 16 tuổi với vai tr&ograve; h&aacute;t nh&oacute;m v&agrave; đ&oacute;ng phim truyền h&igrave;nh, nhưng kh&ocirc;ng để lại nhiều dấu ấn. Kh&ocirc;ng từ bỏ, Minh Hằng tiếp tục theo đuổi đam m&ecirc;, v&agrave; th&agrave;nh c&ocirc;ng của bộ phim&nbsp;<em>Gọi giấc mơ về</em>&nbsp;v&agrave;o năm 2007 đ&atilde; t&ecirc;n tuổi của c&ocirc; được nhiều kh&aacute;n giả biết đến v&agrave; y&ecirc;u th&iacute;ch.&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV1_G3/2013_08_29/image005_copy.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Minh Hằng đạt được th&agrave;nh c&ocirc;ng ở rất nhiều lĩnh vực. Trong &acirc;m nhạc, album đầu tay <em>Một v&ograve;ng tr&aacute;i đất</em>&nbsp;ra mắt v&agrave;o năm 2008 của c&ocirc; đ&atilde; đạt được kỷ lục về gi&aacute; b&aacute;n cao nhất tại thị trường &acirc;m nhạc Việt l&uacute;c bấy giờ. C&aacute;c ca kh&uacute;c: <em>Đến giờ ph&uacute;t n&agrave;y đ&acirc;y</em>, <em>Người v&ocirc; h&igrave;nh</em>, <em>Chia đ&ocirc;i một tr&aacute;i tim</em>&hellip; đều trở th&agrave;nh hit khi ra mắt. C&ocirc; c&ograve;n tham gia diễn xuất ở c&aacute;c bộ phim điện ảnh như <em>Giải cứu thần chết</em>, <em>Những nụ h&ocirc;n rực rỡ</em>. Ngo&agrave;i ra, Minh Hằng c&ograve;n tham gia l&agrave;m người mẫu v&agrave; l&agrave; đại diện nhiều nh&atilde;n h&agrave;ng nổi tiếng.&nbsp;</p>\r\n\r\n<p>&ldquo;Bộ ba quyền lực&rdquo; n&agrave;y sẽ đảm nhiệm vai tr&ograve; gi&aacute;m khảo để lựa chọn ra những th&iacute; sinh xuất sắc nhất cuộc thi t&igrave;m kiếm &ldquo;Đại sứ t&agrave;i năng 2013&rdquo; . Họ sẽ đồng h&agrave;nh c&ugrave;ng th&iacute; sinh trong 7 tập truyền h&igrave;nh thực tế được ph&aacute;t s&oacute;ng l&ecirc;n Yan TV.<br />\r\n<br />\r\nV&ograve;ng sơ tuyển vẫn đang diễn ra rất hấp dẫn tại Website: <a href=\"http://www.ostar.com.vn\" target=\"_blank\">http://www.ostar.com.vn</a>.</p>\r\n\r\n<p><img alt=\"\" src=\"http://stats.ad.zing.vn/piwik.php?idsite=17&amp;rec=1\" style=\"height:1px; width:1px\" />Tư liệu:&nbsp;O&#39;star</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo Tri Thức</p>','Minh Hằng đạt được thành công ở rất nhiều lĩnh vực. Trong âm nhạc, album đầu tay Một vòng trái đất ra mắt vào năm 2008 của cô đã đạt được kỷ lục về giá bán cao nhất tại thị trường âm nhạc Việt lúc bấy giờ. Các ca khúc: Đến giờ phút này đây, Người vô hình, Chia đôi một trái tim… đều trở thành hit khi ra mắt. Cô còn tham gia diễn xuất ở các bộ phim điện ảnh như Giải cứu thần chết, Những nụ hôn rực rỡ. Ngoài ra, Minh Hằng còn tham gia làm người mẫu và là đại diện nhiều nhãn hàng nổi tiếng.','Minh-Hang-ngoi-ghe-nong-quyen-luc',0,0,0,0,0,'','','',''),(10,'2013-09-04 18:09:24','2013-09-04 18:09:24',11,1,1,'Những trang phục trình diễn tai tiếng của sao Việt','<div class=\"summary\">\r\n<p>H&igrave;nh ảnh nhiều nghệ sĩ đ&atilde; bị xấu đi, thậm ch&iacute; phải nhận phạt v&agrave; bị cấm biểu diễn bởi bộ c&aacute;nh kh&ocirc;ng ph&ugrave; hợp tr&ecirc;n s&acirc;n khấu.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan1.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tối 22/8, Angela Phương Trinh biểu diễn với bộ bodysuit m&agrave;u nude may bằng chất vải mỏng, c&oacute; đ&iacute;nh đ&aacute; ở những bộ phận nhạy cảm. Bộ trang phục si&ecirc;u ngắn, khoe to&agrave;n bộ cặp ch&acirc;n trần nuột n&agrave; của c&ocirc;. Dưới &aacute;nh đ&egrave;n s&aacute;ng b&igrave;nh thường, ch&uacute;ng ta c&ograve;n c&oacute; thể nh&igrave;n r&otilde; mồn một nội y đằng sau lớp vải mỏng m&agrave; c&oacute; cũng như kh&ocirc;ng của c&ocirc;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan2.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>C&ograve;n dưới &aacute;nh đ&egrave;n nhập nhoạng, kh&ocirc;ng &iacute;t người lầm tưởng c&ocirc; ca sĩ c&ograve;n trong độ tuổi 17-18 đang... nude. Bộ trang phục khiến c&ocirc;ng ch&uacute;ng li&ecirc;n tưởng ngay đến &quot;thảm họa&quot; Can Lộ Lộ của Trung Quốc. Kh&ocirc;ng những thế, &quot;nhờ&quot; bộ trang phục n&agrave;y, Angela Phương Trinh phải đương đầu với &aacute;n phạt cấm diễn tr&ecirc;n to&agrave;n quốc.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan3.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Trước bộ bodysuit phản cảm đến mức &quot;để đời&quot;, Angela Phương Trinh từng nhiều lần diện v&aacute;y ngủ hay bikini l&ecirc;n s&acirc;n khấu, trước đ&ocirc;ng đảo con mắt hiếu kỳ của kh&aacute;n giả.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan4.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Năm 2012, Angela Phương Trinh cũng từng c&oacute; một bộ trang phục mang tiếng để đời kh&aacute;c tại chương tr&igrave;nh &quot;kh&ocirc;ng d&agrave;nh cho phụ nữ đoan trang&quot;. Với bộ trang phục cũn cỡn v&agrave; phi thẩm mỹ n&agrave;y, c&ocirc; phải hứng chịu &quot;mưa đ&aacute;&quot; từ dư luận.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan5.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Quần si&ecirc;u ngắn, b&oacute; s&aacute;t l&agrave; một trong những phong c&aacute;ch thời trang đang được c&aacute;c mỹ nh&acirc;n Việt rất ưa chuộng khi xuất hiện trước c&ocirc;ng ch&uacute;ng. Vốn l&agrave; một sao nữ c&oacute; l&yacute; lịch kh&aacute; &quot;sạch&quot; về khoản thời trang, Đ&ocirc;ng Nhi khiến c&ocirc;ng ch&uacute;ng hết sức bất ngờ khi xuất hiện với trang phục si&ecirc;u ngắn, b&oacute; s&aacute;t, để lộ v&ugrave;ng nhạy cảm. Đ&acirc;y c&oacute; thể n&oacute;i l&agrave; tai nạn trang phục để đời của c&ocirc;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan6.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Một sao nữ kh&aacute;c vốn được nhớ đến với những trang phục k&iacute;n đ&aacute;o nhưng vẫn quyến rũ l&agrave; Phương Linh. Thế nhưng, khi tr&igrave;nh diễn tr&ecirc;n một chương tr&igrave;nh truyền h&igrave;nh, c&ocirc; diện trang phục xuy&ecirc;n thấu lộ liễu đến qu&aacute; đ&aacute;ng. Ch&uacute;ng ta c&ograve;n nh&igrave;n r&otilde; được 2 miếng m&uacute;t ngực đằng sau lớp vải c&oacute; cũng như kh&ocirc;ng m&agrave; c&ocirc; mặc.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan7.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>D&ugrave; c&ograve;n &iacute;t kinh nghiệm biểu diễn tr&ecirc;n s&acirc;n khấu, Thiều Bảo Tr&acirc;m đ&atilde; kịp g&acirc;y ch&uacute; &yacute; với chiếc quần short si&ecirc;u ngắn để lộ cả v&ograve;ng 3 phản cảm.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan8.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Trong khi đ&oacute;, Thiều Bảo Trang lại bị la &oacute; bởi diện &aacute;o kho&eacute;t n&aacute;ch m&agrave; kh&ocirc;ng th&egrave;m mặc &aacute;o qu&acirc;y để che chắn v&ograve;ng 1.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan9.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Vừa lộ v&ugrave;ng nhạy cảm, Thu Thủy vừa bị mất điểm bở