"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan13.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>C&ugrave;ng l&agrave; chất vải m&agrave;u da nhưng Maya lại cẩn thận hơn khi chọn loại vải d&agrave;y dặn. D&ugrave; vậy, kh&aacute;n giả lại nhớ đến c&ocirc; bởi độ xấu v&agrave; lạ của trang phục, với điểm nhấn l&agrave; chi tiết đ&iacute;nh đ&aacute; qu&aacute; nặng mắt v&agrave; rối rắm.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan14.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Trước khi &quot;đoan trang&quot; như hiện tại, Thu Minh từng g&acirc;y cho&aacute;ng tr&ecirc;n mọi trang b&aacute;o khi tr&igrave;nh diễn với bộ trang phục &quot;chia 5 xẻ 7&quot;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan15.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Bộ trang phục qu&aacute; tho&aacute;ng m&aacute;t cộng với những bước nhảy s&ocirc;i động khiến Thu Minh bị lộ v&ograve;ng 1. C&ocirc; đ&atilde; c&oacute; những ph&uacute;t hớ h&ecirc;nh trước sự chứng kiến của kh&aacute;n giả ngồi dưới kh&aacute;n đ&agrave;i. V&igrave; trang phục n&agrave;y, c&ocirc; phải nhận &aacute;n phạt từ Sở Văn h&oacute;a.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan16.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Chịu chung cảnh ngộ với Thu Minh l&agrave; Th&aacute;i H&agrave; với vụ lộ gần hết v&ograve;ng 1 tr&ecirc;n s&acirc;n khấu. Phần tr&ecirc;n trang phục của c&ocirc; chỉ đơn thuần l&agrave; một chiếc &aacute;o l&oacute;t kh&ocirc;ng hơn kh&ocirc;ng k&eacute;m.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan17.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Minh Hằng đ&atilde; thực sự g&acirc;y sốc với kh&aacute;n giả trong đ&ecirc;m tiệc &quot;Mỹ Nh&acirc;n&quot; được tổ chức tại Quảng B&igrave;nh, c&ocirc; diện chiếc quần ren khoe r&otilde; da thịt kể từ phần rốn trở xuống, tr&ocirc;ng rất phản cảm. Chiếc quần n&agrave;y khiến nhiều người phải đỏ mặt v&igrave; độ t&aacute;o bạo v&agrave; gi&uacute;p c&ocirc; lu&ocirc;n c&oacute; t&ecirc;n trong danh s&aacute;ch những nghệ sĩ c&oacute; trang phục tr&igrave;nh diễn để đời.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan18.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nếu như Minh Hằng c&ograve;n chịu kh&oacute; mặc quần d&agrave;i, Thủy Ti&ecirc;n lại bị phản ứng bởi bộ trang phục kh&ocirc;ng kh&aacute;c nội y l&agrave; bao.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan19.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Với độ ngắn l&ecirc;n đến mức tối thiểu, Đoan Trang đ&atilde; bị hớ h&ecirc;nh.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan20.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tuy trang phục kh&ocirc;ng hở ch&uacute;t n&agrave;o, nhưng bộ bodysuit của Yến Trang lại &aacute;p đảo về độ... kinh dị.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/myndn/2013_09_04/khoethan21.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tr&agrave; Ngọc Hằng cũng sở hữu một trang phục tr&igrave;nh diễn kh&ecirc;u gợi qu&aacute; đ&agrave;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo TTVN</p>','Hình ảnh nhiều nghệ sĩ đã bị xấu đi, thậm chí phải nhận phạt và bị cấm biểu diễn bởi bộ cánh không phù hợp trên sân khấu.','Nhung-trang-phuc-trinh-dien-tai-tieng-cua-sao-Viet',0,0,0,0,0,'','','',''),(11,'2013-09-04 18:11:06','2013-09-04 18:11:06',12,1,1,'Những tính năng của Oppo được người dùng đánh giá cao','<div class=\"content\">\r\n<p><strong>Find Clover: Gi&aacute; tốt cho m&aacute;y tốt</strong></p>\r\n\r\n<p>Chương tr&igrave;nh <em>Trải nghiệm Clover</em><strong> </strong>do Oppo Việt Nam tổ chức đ&atilde; kh&eacute;p lại tuần trước với nhiều b&agrave;i viết chia sẻ mang đậm dấu ấn c&aacute; nh&acirc;n v&agrave; nhận được đ&aacute;nh gi&aacute; cao từ ban tổ chức cũng như cộng đồng. Kết quả, giải thưởng chiếc smartphone Find Clover miễn ph&iacute; đ&atilde; thuộc về th&agrave;nh vi&ecirc;n Nguyễn Đức Lu&acirc;n (nick diễn đ&agrave;n mrducluan) với b&agrave;i viết &ldquo;Oppo Clover - Vi&ecirc;n ngọc nhỏ nhưng s&aacute;ng&rdquo;.</p>\r\n\r\n<p><strong>Kh&aacute;c biệt từ hệ thống &acirc;m thanh</strong></p>\r\n\r\n<p>Kh&ocirc;ng bất ngờ khi đa số người tham gia trải nghiệm đ&aacute;nh gi&aacute; cao hiệu năng chơi nhạc của Find Clover. T&acirc;m đắc với chip xử l&yacute; &acirc;m thanh ri&ecirc;ng biệt của tập đo&agrave;n Texas Instrument v&agrave; d&agrave;n loa k&eacute;p của m&aacute;y, người d&ugrave;ng datnguyenkts cho biết: &ldquo;Thiết kế 2 loa Hi-Fi stereo kết hợp với c&ocirc;ng nghệ Dolby cho chất lượng &acirc;m thanh khi nghe loa ngo&agrave;i tốt, &acirc;m thanh c&oacute; &acirc;m lượng kh&aacute; lớn, độ chi tiết cao. Kh&ocirc;ng chỉ vậy, chất lượng &acirc;m thanh qua tai nghe thực sự l&agrave;m t&ocirc;i ấn tượng với &acirc;m bass kh&aacute; tốt, chất &acirc;m trong trẻo&rdquo;.</p>\r\n\r\n<p>Một người d&ugrave;ng kh&aacute;c c&oacute; nick lahan1234 cũng c&oacute; đ&aacute;nh gi&aacute; ri&ecirc;ng về c&ocirc;ng nghệ &acirc;m thanh Dirac độc quyền của h&atilde;ng tr&ecirc;n chiếc điện thoại mới n&agrave;y: &ldquo;Sau gần một tuần phi&ecirc;u c&ugrave;ng &acirc;m nhạc th&igrave; m&igrave;nh nhận thấy Dirac nặng về treble, &acirc;m hơi cao, bạn sẽ cảm thấy rất tuyệt khi nghe Bằng Kiều h&aacute;t&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV2_G3/2013_09_03/image001.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Được thừa hưởng thế mạnh từ những sản phẩm &acirc;m thanh đ&agrave;n anh đi trước như MP3, Blu-ray, đ&acirc;y l&agrave; d&ograve;ng điện thoại thực sự chinh phục được tai nghe của người d&ugrave;ng th&iacute;ch chơi nhạc. Ngo&agrave;i đầu tư về chất &acirc;m, c&aacute;ch chơi nhạc cũng được quan t&acirc;m khi h&atilde;ng n&agrave;y d&agrave;nh hẳn một giao diện ri&ecirc;ng với kiểu d&aacute;ng chiếc đĩa than c&ugrave;ng cần đọc mang phong c&aacute;ch cổ điển.</p>\r\n\r\n<p><strong>Hiệu năng cao - pin tốt</strong></p>\r\n\r\n<p>Những smartphone ng&agrave;y nay rất được người d&ugrave;ng quan t&acirc;m về hiệu năng hoạt động cũng như thời gian sử dụng pin của m&aacute;y. Ch&iacute;nh v&igrave; vậy, trải nghiệm thực tế trong thời gian d&agrave;i l&agrave; c&aacute;ch trung thực nhất để người d&ugrave;ng kiểm chứng thời lượng pin của chiếc điện thoại n&agrave;y.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV2_G3/2013_09_03/image003_copy.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Sử dụng vi xử l&yacute; 4 nh&acirc;n Cortex A7 xung nhịp 1.2GHz, tr&ecirc;n d&acirc;y chuyền c&ocirc;ng nghệ 28nm gi&uacute;p m&aacute;y tiết kiệm điện năng v&agrave; tản nhiệt tốt hơn. Với c&ugrave;ng sở th&iacute;ch chơi game đua xe tr&ecirc;n di động, c&aacute;c ch&agrave;ng trai tham gia chương tr&igrave;nh trải nghiệm đều c&oacute; c&ugrave;ng nhận x&eacute;t m&aacute;y chạy rất mượt, kh&ocirc;ng c&oacute; hiện tượng giật hay n&oacute;ng m&aacute;y khi chơi game Asphalt 6, 7. Ngo&agrave;i ra c&aacute;c game kh&aacute;c kh&aacute; phổ biến như Fruit Ninja, Star War, PvZ&hellip; cũng được người d&ugrave;ng đ&aacute;nh gi&aacute; tốt với đồ họa hiển thị đẹp, m&aacute;y xử l&yacute; tốt khi chơi tr&ecirc;n Clover, nhanh hơn kh&aacute; nhiều so với c&aacute;c d&ograve;ng m&aacute;y ph&acirc;n kh&uacute;c 5 triệu.</p>\r\n\r\n<p>Cũng theo chia sẻ từ người d&ugrave;ng c&oacute; nick datnguyenkts, ngo&agrave;i pin 1.700mAh c&ugrave;ng kiến tr&uacute;c 28nm tr&ecirc;n chip 4 nh&acirc;n như đ&atilde; n&ecirc;u ở tr&ecirc;n, nh&agrave; sản xuất c&ograve;n t&iacute;ch hợp th&ecirc;m Boot Manager (quản l&yacute; khởi động), Pure Background (ứng dụng chạy nền) với khả năng chỉnh permisson của từng ứng dụng gi&uacute;p việc quản l&yacute; c&aacute;c ứng dụng hiệu quả v&agrave; tiết kiệm pin hơn.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV2_G3/2013_09_03/image005_copy.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Đồng h&agrave;nh c&ugrave;ng người ti&ecirc;u d&ugrave;ng</strong></p>\r\n\r\n<p>Ngo&agrave;i ra, c&aacute;c vấn đề về camera, m&agrave;n h&igrave;nh, thiết kế&hellip; cũng được kh&ocirc;ng &iacute;t người d&ugrave;ng quan t&acirc;m v&agrave; chia sẻ. C&oacute; thể n&oacute;i, nhờ chương tr&igrave;nh <em>Trải nghiệm Clover</em> lần n&agrave;y, những người y&ecirc;u th&iacute;ch sản phẩm Oppo v&agrave; cả những người đang quan t&acirc;m nhưng vẫn c&ograve;n do dự v&igrave; nhiều l&yacute; do kh&aacute;c nhau, đ&atilde; c&oacute; được cơ hội trải nghiệm thực sự, được chia sẻ những &yacute; kiến c&aacute; nh&acirc;n v&agrave; giao lưu c&ugrave;ng cộng đồng mạng. Nickname prin77 - một th&agrave;nh vi&ecirc;n tham gia chương tr&igrave;nh - cho biết: &ldquo;Đ&acirc;y l&agrave; chiếc điện thoại thiết kế đẹp, hiệu năng cao, nghe nhạc hay, chụp ảnh tốt. Nếu kh&ocirc;ng t&iacute;nh tới gi&aacute; trị thương hiệu th&igrave; đ&acirc;y l&agrave; một sản phẩm tốt nhất trong tầm gi&aacute;&rdquo;.</p>\r\n\r\n<p>Cũng tham gia chương tr&igrave;nh trải nghiệm nhưng v&igrave; nhiều l&yacute; do, một v&agrave;i th&agrave;nh vi&ecirc;n đ&atilde; kh&ocirc;ng kịp viết b&agrave;i dự thi, nhưng họ cũng đ&atilde; c&oacute; phản hồi tốt sau khi sử dụng m&aacute;y.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV2_G3/2013_09_03/image007_copy.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Chương tr&igrave;nh đ&atilde; khẳng định phương ch&acirc;m lu&ocirc;n lu&ocirc;n lắng nghe v&agrave; tiếp thu &yacute; kiến kh&aacute;ch h&agrave;ng của Oppo. Th&ocirc;ng qua chương tr&igrave;nh n&agrave;y, h&atilde;ng đ&atilde; c&oacute; cơ hội tiếp x&uacute;c gần gũi, hiểu được những mong muốn, nguyện vọng của người ti&ecirc;u d&ugrave;ng để sản phẩm đưa ra thị trường ng&agrave;y một ho&agrave;n thiện hơn.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV2_G3/2013_09_03/image009_copy.jpg\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/CTV2_G3/2013_09_03/image013.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ảnh chụp thực tế từ Find Clover. Ảnh do người tham gia trải nghiệm chụp.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\"\" src=\"http://stats.ad.zing.vn/piwik.php?idsite=17&amp;rec=1\" style=\"height:1px; width:1px\" />Tư liệu: Oppo</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo Tri Thức</p>','Những bài viết của các thành viên được thể hiện với nhiều phong cách từ đánh giá chuyên nghiệp, trải nghiệm cá nhân sâu sắc cho tới “style kiếm hiệp” ấn tượng, đem lại cái nhìn đa dạng về chiếc điện thoại của Oppo.','Nhung-tinh-nang-cua-Oppo-duoc-nguoi-dung-danh-gia-cao',0,0,0,0,0,'','','',''),(12,'2013-09-04 18:13:10','2013-11-14 15:39:47',13,1,1,'Microsoft đã rình ‘con mồi’ Nokia như thế nào?','<div class=\"summary\">\r\n<p>Microsoft đ&atilde; chứng tỏ họ đ&iacute;ch thực l&agrave; một thợ săn l&atilde;o luyện khi th&acirc;u t&oacute;m th&agrave;nh c&ocirc;ng bộ phận sản xuất thiết bị di động của Nokia với gi&aacute; 7,2 tỷ USD.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<p>Thương vụ Microsoft th&acirc;u t&oacute;m Nokia kh&ocirc;ng g&acirc;y bất ngờ lớn cho giới c&ocirc;ng nghệ, bởi từ l&acirc;u việc g&atilde; khổng lồ ng&agrave;nh phần mềm th&egrave;m muốn bộ phận sản xuất di động của Nokia l&agrave; c&oacute; thật. Vấn đề l&agrave; ở chỗ, Microsoft đ&atilde; chứng tỏ m&igrave;nh l&agrave; một đạo diễn t&agrave;i ba, khi &ldquo;l&agrave;m gỏi&rdquo; con mồi Nokia (thực chất l&agrave; bộ phận sản xuất thiết bị di động) đ&uacute;ng v&agrave;o l&uacute;c c&ocirc;ng ty n&agrave;y c&oacute; dấu hiệu khởi sắc nhất định, trong khi gi&aacute; mua lại th&igrave; vẫn đặc biệt thấp.</p>\r\n\r\n<p><strong>Stephen Elop - &ldquo;gi&aacute;n điệp nằm v&ugrave;ng&rdquo;?</strong></p>\r\n\r\n<p>Từ l&acirc;u, giới ph&acirc;n t&iacute;ch đ&atilde; nghi ngờ về việc Microsoft &ldquo;c&agrave;i&rdquo; gi&aacute;n điệp v&agrave;o Nokia. Mục đ&iacute;ch của vị gi&aacute;n điệp n&agrave;y kh&ocirc;ng g&igrave; kh&aacute;c l&agrave; &ldquo;d&igrave;m&rdquo; Nokia xuống vũng b&ugrave;n của sự khủng hoảng nhưng vẫn kh&ocirc;ng mất đi những g&igrave; tinh t&uacute;y nhất, phục vụ cho việc th&acirc;u t&oacute;m n&oacute;i tr&ecirc;n.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Thanhnd/2013_09_03/StephenElop.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cựu CEO Stephen Elop bị coi l&agrave; &quot;gi&aacute;n điệp&quot; cho Microsoft.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Nếu những tin đồn đ&oacute; đ&uacute;ng sự thật, Elop ch&iacute;nh l&agrave; một &ldquo;gi&aacute;n điệp&rdquo; đại t&agrave;i. &Ocirc;ng n&agrave;y bắt đầu đảm nhiệm cương vị CEO của Nokia từ ng&agrave;y 21/9/2010, c&aacute;ch đ&acirc;y khoảng 3 năm. Tại thời điểm đ&oacute;, &ocirc;ng ch&iacute;nh l&agrave; vị CEO đầu ti&ecirc;n của Nokia kh&ocirc;ng mang quốc tịch Phần Lan (Elop l&agrave; người Canada). Nokia từng tuy&ecirc;n bố họ đ&atilde; phải chi 6 triệu USD tiền ph&iacute; &ldquo;l&oacute;t tay&rdquo; để &ldquo;bồi thường cho phần thu nhập bị tổn thất của Elop ở vị tr&iacute; cũ&rdquo;, c&ugrave;ng mức lương 1,4 triệu USD/năm.</p>\r\n\r\n<p>Ngay sau khi gia nhập c&ocirc;ng ty, &ocirc;ng n&agrave;y đ&atilde; gửi đến c&aacute;c nh&acirc;n vi&ecirc;n một bản memo (ghi nhớ) mang t&ecirc;n &ldquo;con t&agrave;u ch&aacute;y&rdquo; kinh điển. Bản ghi nhớ n&agrave;y đề cập đến việc Nokia đang đứng tr&ecirc;n bờ vực của sự diệt vong nếu vẫn tiếp tục gắn b&oacute; với &ldquo;con t&agrave;u ch&aacute;y&rdquo; Symbian, v&agrave; k&ecirc;u gọi Nokia cần h&agrave;nh động ngay. C&aacute;c phương tiện truyền th&ocirc;ng khi đ&oacute; gọi bản ghi nhớ n&oacute;i tr&ecirc;n l&agrave; một lời cảnh tỉnh, c&ograve;n<em> BBC</em> của Anh th&igrave; m&ocirc; tả n&oacute; như l&agrave; &ldquo;một trong những t&agrave;i liệu nội bộ nổi tiếng nhất, hấp dẫn nhất đến từ một c&ocirc;ng ty lớn&rdquo;.</p>\r\n\r\n<p>Th&aacute;ng 2/2011, Elop ch&iacute;nh thức tuy&ecirc;n bố khai tử nền tảng Symbian để bắt tay với Microsoft, sử dụng hệ điều h&agrave;nh Windows Phone. L&yacute; giải cho h&agrave;nh động chọn Windows Phone thay v&igrave; Android, Elop chỉ d&ugrave;ng một từ duy nhất, đ&oacute; l&agrave; &ldquo;sự kh&aacute;c biệt&rdquo;. Theo &ocirc;ng, Nokia sẽ kh&ocirc;ng thể tạo ra sự kh&aacute;c biệt bởi họ đ&atilde; chậm ch&acirc;n tr&ecirc;n nền tảng Android.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Thanhnd/2013_09_03/nokiaburningplatform.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nokia khi đ&oacute; bị coi l&agrave; một con t&agrave;u ch&aacute;y.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Giai đoạn đen tối của Nokia</strong></p>\r\n\r\n<p>Th&aacute;ng 11/2011, Nokia cho ra mắt chiếc smartphone đầu ti&ecirc;n chạy Windows Phone l&agrave; Lumia 800, tiếp sau đ&oacute; l&agrave; model cao cấp nhất - chiếc Lumia 900. Windows Phone 7 khi đ&oacute; vẫn c&ograve;n rất ngh&egrave;o n&agrave;n, thậm ch&iacute; kh&ocirc;ng hỗ trợ chip l&otilde;i k&eacute;p, nhưng Nokia cũng đ&atilde; kịp tạo được ấn tượng nhất định.</p>\r\n\r\n<p>Tuy nhi&ecirc;n, chỉ v&agrave;i th&aacute;ng sau, người d&ugrave;ng Lumia lập tức ng&atilde; ngửa, bởi Microsoft giới thiệu nền tảng Windows Phone 8 v&agrave; kh&ocirc;ng hỗ trợ c&aacute;c sản phẩm đời trước. Đến l&uacute;c n&agrave;y, người ta chợt nhận ra, Nokia đ&atilde; chẳng kh&aacute;c g&igrave; &ldquo;c&aacute; nằm tr&ecirc;n thớt&rdquo; v&agrave; động th&aacute;i &ldquo;x&uacute;c phạm người d&ugrave;ng&rdquo; của Microsoft chẳng qua l&agrave; để &ldquo;d&igrave;m&rdquo; Nokia l&uacute;n s&acirc;u v&agrave;o khủng hoảng, nhằm mua lại c&ocirc;ng ty n&agrave;y với mức gi&aacute; thấp nhất c&oacute; thể.</p>\r\n\r\n<p>Trong giai đoạn 2011 - 2012, Nokia lần lượt sa thải hơn 20.000 nh&acirc;n vi&ecirc;n để t&aacute;i cơ cấu, b&aacute;n thương hiệu điện thoại si&ecirc;u sang Vertu, thậm ch&iacute; b&aacute;n lu&ocirc;n trụ sở ch&iacute;nh tại Phần Lan, sau đ&oacute; lập tức thu&ecirc; lại để tiết kiệm tiền mặt. Nokia li&ecirc;n tiếp b&aacute;o lỗ trong c&aacute;c bản b&aacute;o c&aacute;o t&agrave;i ch&iacute;nh h&agrave;ng qu&yacute;, trung b&igrave;nh l&ecirc;n đến cả tỷ USD mỗi qu&yacute;. Cho đến qu&yacute; I năm nay, khi Nokia đ&atilde; l&agrave;m ăn khởi sắc hơn hẳn, h&atilde;ng n&agrave;y vẫn lỗ khoảng 150 triệu euro.</p>\r\n\r\n<p><strong>Bị th&acirc;u t&oacute;m</strong></p>\r\n\r\n<p>Đỉnh điểm của sự bất m&atilde;n từ c&aacute;c cổ đ&ocirc;ng của Nokia đến từ một cuộc họp Hội đồng quản trị hồi th&aacute;ng 5. Khi đ&oacute;, c&aacute;c cổ đ&ocirc;ng của Nokia đ&atilde; thẳng thắn ph&ecirc; ph&aacute;n Elop đ&atilde; chọn sai đường v&agrave; Nokia đang &ldquo;tr&ecirc;n đường xuống địa ngục&rdquo;. Tất nhi&ecirc;n, c&acirc;u trả lời c&aacute;c cổ đ&ocirc;ng nhận được từ Elop l&agrave; họ đ&atilde; kh&ocirc;ng c&ograve;n đường để quay lại.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Thanhnd/2013_09_03/Lumiamicrosoft.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sẽ kh&ocirc;ng c&ograve;n smartphone mang thương hiệu Nokia.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>T&iacute;nh từ thời điểm Elop l&ecirc;n đảm nhiệm cương vị CEO của Nokia cho đến th&aacute;ng 6/2013, cổ phiếu của h&atilde;ng n&agrave;y đ&atilde; giảm 85%, thị phần điện thoại giảm từ 23,4% xuống c&ograve;n 14,8%, trong khi thị phần smartphone cũng giảm từ 11,7% xuống c&ograve;n 8,8%.</p>\r\n\r\n<p>Ngay sau đ&oacute;, đ&atilde; c&oacute; những tin đồn về việc Microsoft đề nghị về một vụ chuyển nhượng bộ phận sản xuất di động của Nokia nhưng bị từ chối. Tuy nhi&ecirc;n, c&oacute; vẻ như mọi chuyện đ&atilde; được giải quyết ổn thỏa trong lần đề nghị mới n&agrave;y, v&agrave; hiện tại, bộ phận sản xuất di động của Nokia đ&atilde; thuộc về Microsoft với gi&aacute; 7,2 tỷ USD.</p>\r\n\r\n<p>Con số n&agrave;y tất nhi&ecirc;n thấp hơn nhiều so với mức 12 tỷ USD Google bỏ ra mua Motorola trong khi x&eacute;t về tiềm năng v&agrave; số lượng bản quyền s&aacute;ng chế, Nokia đều được đ&aacute;nh gi&aacute; cao hơn hẳn so với đối thủ.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"notebox ncenter\">\r\n<p><strong>Một số th&ocirc;ng tin đ&aacute;ng ch&uacute; &yacute; trong thương vụ Microsoft mua lại bộ phận sản xuất di động của Nokia:</strong></p>\r\n\r\n<p>- Microsoft c&oacute; quyền sở hữu bộ phận sản xuất thiết bị v&agrave; dịch vụ của Nokia, bao gồm bộ phận sản xuất điện thoại phổ th&ocirc;ng, thiết bị th&ocirc;ng minh, đội ngũ thiết kế sản phẩm v&agrave; c&aacute;c bộ phận hỗ trợ.</p>\r\n\r\n<p>- Tổng cộng c&oacute; khoảng 32.000 nh&acirc;n vi&ecirc;n Nokia sẽ được dịch chuyển sang Microsoft, chi ph&iacute; ước t&iacute;nh cho việc dịch chuyển n&agrave;y (cả ph&iacute; mua b&aacute;n) c&oacute; thể l&ecirc;n đến 14,9 tỷ euro - bằng 50% doanh thu của Nokia trong to&agrave;n bộ năm 2012.</p>\r\n\r\n<p>- Nokia cho ph&eacute;p Microsoft sử dụng một số bằng s&aacute;ng chế (kh&ocirc;ng c&oacute; trong danh s&aacute;ch mua) của Nokia trong v&ograve;ng 10 năm.</p>\r\n\r\n<p>- Ri&ecirc;ng dịch vụ bản đồ HERE, Microsoft phải trả tiền bản quyền trong v&ograve;ng 4 năm tới. Như vậy, Microsoft sẽ l&agrave; đối t&aacute;c thứ 3 sử dụng dịch vụ bản đồ n&agrave;y của Nokia.</p>\r\n\r\n<p>- Microsoft được ph&eacute;p sử dụng thương hiệu Nokia tr&ecirc;n c&aacute;c d&ograve;ng điện thoại phổ th&ocirc;ng trong v&ograve;ng 10 năm tới. Ri&ecirc;ng thương hiệu Nokia vẫn thuộc quyền sở hữu của c&ocirc;ng ty Phần Lan.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<p>Th&agrave;nh Duy</p>\r\n\r\n<p>Theo Tri Thức</p>','Microsoft đã chứng tỏ họ đích thực là một thợ săn lão luyện khi thâu tóm thành công bộ phận sản xuất thiết bị di động của Nokia với giá 7,2 tỷ USD','Microsoft-da-rinh-con-moi-Nokia-nhu-the-nao',0,0,0,0,0,'','','',''),(13,'2013-09-04 18:23:24','2013-09-04 18:23:24',14,1,1,'Người Sài Gòn dựng \'đê\' chắn sóng tràn vào nhà','<div class=\"summary\">\r\n<p>Cơn mưa lớn v&agrave;o chiều qua (3/9) kh&ocirc;ng chỉ l&agrave;m nhiều con đường bị ngập cả m&eacute;t, m&agrave; nước c&ograve;n tr&agrave;n v&agrave;o nh&agrave; d&acirc;n g&acirc;y hư hỏng đồ đạc. Nhiều gia đ&igrave;nh phải d&ugrave;ng v&aacute;n, bao tải c&aacute;t... để ngăn nước v&agrave; r&aacute;c v&agrave;o nh&agrave;.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n	</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/1_1.JPG\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Đường bị ngập nặng, mỗi khi xe &ocirc; t&ocirc; chạy qua th&igrave; tạo n&ecirc;n từng đợt s&oacute;ng đ&aacute;nh nước v&agrave; r&aacute;c v&agrave;o nh&agrave; d&acirc;n.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/2.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nếu kh&ocirc;ng đ&ocirc;n nền, x&acirc;y tường chắn, nước sẽ ngập s&acirc;u, mọi hoạt động bị t&ecirc; liệt nhiều giờ.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/3_1.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Giải ph&aacute;p l&acirc;u d&agrave;i sống chung với mưa ngập l&agrave; x&acirc;y nền cao, th&ecirc;m tường chắn. Tuy nhi&ecirc;n như thế vẫn kh&ocirc;ng chống lại được những đợt s&oacute;ng đ&aacute;nh v&agrave;o, v&igrave; thế một hộ kinh doanh b&ecirc;n đường H&ograve;a B&igrave;nh (Q.11) phải dựng th&ecirc;m tấm chắn cao hơn nửa m&eacute;t.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/3_2.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>C&oacute; người c&ograve;n x&acirc;y dựng bờ tường để ngăn nước. Trong ảnh: Một số hộ d&acirc;n x&acirc;y bờ tường chống nước ngập tr&ecirc;n đường Phan Huy &Iacute;ch, Q.G&ograve; Vấp.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/4.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Một nh&acirc;n vi&ecirc;n cửa h&agrave;ng d&ugrave;ng tấm v&aacute;n chắn s&oacute;ng nước đ&aacute;nh v&agrave;o ở đường Đồng Đen (Q.T&acirc;n B&igrave;nh) chiều 3/9.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/5_1.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Người n&agrave;y d&ugrave;ng tấm v&aacute;n cao gần 1m nhưng những con s&oacute;ng lớn vẫn t&eacute; nước v&agrave;o nh&agrave;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/5_3.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&quot;Nước đ&atilde; ngập v&agrave;o nh&agrave; rồi, giờ d&ugrave;ng những tấm v&aacute;n n&agrave;y chỉ để ngăn r&aacute;c th&ocirc;i&quot;, một người d&acirc;n cho biết.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/5_4.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tuy nền nh&agrave; đ&atilde; n&acirc;ng l&ecirc;n cao nhưng vẫn kh&ocirc;ng thể chống lại được những con s&oacute;ng nước.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/6_1.JPG\" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/6_2.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Những tấm bạt được tận dụng để che nước t&eacute; v&agrave;o.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/7.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Bao tải đựng c&aacute;t được dựng l&ecirc;n.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/8_1.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Huy động cả nh&acirc;n vi&ecirc;n d&ugrave;ng bạt v&agrave; bao tải c&aacute;t che chắn cho cửa h&agrave;ng</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/8_2.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cố gắng trong mớ hỗn độn để bảo vệ h&agrave;ng h&oacute;a trước d&ograve;ng nước đen.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/10_1.JPG\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/10_2.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Vừa chắn s&oacute;ng vừa canh nước đen tr&agrave;n v&agrave;o nh&agrave; ở đường H&ograve;a B&igrave;nh.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/10_3.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>D&ugrave;ng cả tảng b&ecirc; t&ocirc;ng lớn, sọt r&aacute;c để k&egrave; tấm v&aacute;n v&agrave; bạt.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/10_5.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Trực canh s&oacute;ng đ&aacute;nh hư bạt tr&ecirc;n đường Đồng Đen.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/11.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>D&ugrave;ng c&aacute;nh cửa để ngăn nước.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/12.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>S&oacute;ng đ&aacute;nh rơi v&aacute;n chắn, cả gia đ&igrave;nh tập trung chống ngập.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/13.JPG\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/Quanlv/2013_09_04/14_2.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Khi nước r&uacute;t dần, người d&acirc;n bắt đầu qu&eacute;t r&aacute;c, b&ugrave;n, đất, nước h&ocirc;i thối ra ngo&agrave;i.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<p>L&ecirc; Qu&acirc;n</p>\r\n\r\n<p>Theo Tri Thức</p>','Cơn mưa lớn vào chiều qua (3/9) không chỉ làm nhiều con đường bị ngập cả mét, mà nước còn tràn vào nhà dân gây hư hỏng đồ đạc. Nhiều gia đình phải dùng ván, bao tải cát... để ngăn nước và rác vào nhà.','Nguoi-Sai-Gon-dung-de-chan-song-tran-vao-nha',0,0,0,0,0,'','','',''),(14,'2013-09-04 18:25:21','2013-09-05 10:02:37',15,1,1,'Trang phục quá sang trọng có thể khiến phụ nữ chết oan','<div class=\"summary\">\r\n<p>H&agrave;ng ngh&igrave;n phụ nữ c&oacute; thể chết oan v&igrave; đột quỵ do c&aacute;c b&aacute;c sĩ kh&ocirc;ng thể ph&aacute;t hiện những triệu chứng quan trọng li&ecirc;n quan tới bệnh tim khi kh&aacute;m bệnh.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<p>&quot;Trong trang phục sang trọng, kiểu t&oacute;c thời trang v&agrave; lớp son phấn l&ograve;e loẹt, con người c&oacute; vẻ khỏe mạnh hơn so với thực trạng thể chất thực tế của họ&quot;, nhiều b&aacute;c sĩ thừa nhận.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/thegioi/2013_09_04/quy_ba.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Khi phụ nữ trong trang phục đẹp v&agrave; sang trọng bước v&agrave;o ph&ograve;ng kh&aacute;m, c&aacute;c b&aacute;c sĩ sẽ kh&ocirc;ng thể dự đo&aacute;n ch&iacute;nh x&aacute;c c&aacute;c vấn đề về tim mạch trong cơ thể họ. Ảnh:<em> wordpress.com. </em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Một nghi&ecirc;n cứu do bệnh viện Pitie Salpetriere thuộc Viện Tim tại Paris, Ph&aacute;p tiến h&agrave;nh đối với hơn 15.000 người cho thấy nguy cơ tử vong v&igrave; đột quỵ ở phụ nữ cao hơn tới 1,5 lần so với nam giới, <em>Telegraph</em> đưa tin.</p>\r\n\r\n<p>Thế nhưng việc chẩn đo&aacute;n nguy cơ đột quỵ ở phụ nữ lại kh&oacute; hơn nhiều so với nam giới. Chẳng hạn, đối với chứng rung nhĩ (một trong những nguy&ecirc;n nh&acirc;n g&acirc;y đột quỵ h&agrave;ng đầu) ở người dưới 70 tuổi, nguy cơ b&aacute;c sĩ bỏ s&oacute;t phụ nữ cao hơn tới 56% so với nam giới.</p>\r\n\r\n<p>&quot;T&ocirc;i nghĩ rằng nhiều b&aacute;c sĩ tim mạch kh&ocirc;ng nhận ra nguy cơ đột quỵ đối với phụ nữ. Họ thường nghĩ rằng nếu một phụ nữ mặc trang phục sang trọng, trang điểm tinh tế th&igrave; sức khỏe của c&ocirc; ấy b&igrave;nh thường. V&igrave; thế m&agrave; họ rất dễ bỏ qua nguy cơ đột quỵ&quot;, b&aacute;c sĩ Pierre Sabouret, một chuy&ecirc;n gia của bệnh viện Pitie Salpetriere, ph&aacute;t biểu.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>C&aacute;c thống k&ecirc; cho thấy c&aacute;c vấn đề tim mạch tấn c&ocirc;ng 1/14 người tr&ecirc;n 65 tuổi, g&acirc;y n&ecirc;n t&igrave;nh trạng tim đập nhanh, hoa mắt hoặc đau ngực. Tuy nhi&ecirc;n, phần lớn nạn nh&acirc;n kh&ocirc;ng thể cảm nhận triệu chứng. Nguy cơ đột quỵ tăng rất nhanh theo tuổi. Anh l&agrave; một trong những nước m&agrave; tỷ lệ người từng đột quỵ cao nhất thế giới. Khoảng 15.000 trường hợp đột quỵ xảy ra tại Anh mỗi năm.</p>\r\n</div>\r\n\r\n<p>Quỳnh Trang</p>\r\n\r\n<p>Theo Tri Thức</p>','Hàng nghìn phụ nữ có thể chết oan vì đột quỵ do các bác sĩ không thể phát hiện những triệu chứng quan trọng liên quan tới bệnh tim khi khám bệnh.','Trang-phuc-qua-sang-trong-co-the-khien-phu-nu-chet-oan',0,0,0,0,0,'','','',''),(15,'2013-09-04 18:26:51','2013-09-04 21:58:04',16,1,1,'10 dã thú nguy hiểm nhất hành tinh','<div class=\"summary\">\r\n<p>Những lo&agrave;i động vật như h&agrave; m&atilde;, sư tử, c&aacute; mập, gấu x&aacute;m... được liệt v&agrave;o danh s&aacute;ch nguy hiểm bậc nhất thế giới hiện nay.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong><img alt=\"\" class=\"oImage\" src=\"http://img2.news.zing.vn/2013/06/26/1-9.jpg\" style=\"height:349px; width:500px\" /></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>H&agrave; M&atilde;: Lo&agrave;i n&agrave;y thường xuất hiện nhiều ở ch&acirc;u Phi v&agrave; độ hung bạo của ch&uacute;ng mạnh hơn bất cứ lo&agrave;i vật k&iacute;ch thước lớn n&agrave;o. Trọng lượng trung b&igrave;nh l&ecirc;n tới 1,5 tấn v&agrave; h&agrave;m răng c&oacute; sức mạnh tương đương với một chiếc b&uacute;a tạ cỡ lớn.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;<img alt=\"\" class=\"oImage\" src=\"http://img2.news.zing.vn/2013/06/26/2-9.jpg\" style=\"height:390px; width:500px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sứa hộp: Đ&acirc;y được biết đến l&agrave; lo&agrave;i sinh vật độc nhất từng xuất hiện từ trước tới nay. Mỗi con sứa loại n&agrave;y c&oacute; 60 x&uacute;c tu v&agrave; đ&acirc;y cũng l&agrave; vũ kh&iacute;.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;<img alt=\"\" class=\"oImage\" src=\"http://img2.news.zing.vn/2013/06/26/3-6.jpg\" style=\"height:374px; width:500px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>C&aacute; mập trắng lớn: Với chiều d&agrave;i 6 m c&ugrave;ng trọng lượng hơn 2 tấn, đ&acirc;y được xem l&agrave; lo&agrave;i c&aacute; ăn thịt nguy hiểm nhất đại dương. Với h&agrave;m răng gồm 300 chiếc v&agrave; sắc như răng cưa, ch&uacute;ng thường tấn c&ocirc;ng con mồi bằng những c&uacute; đớp ch&iacute; mạng.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;<img alt=\"\" class=\"oImage\" src=\"http://img2.news.zing.vn/2013/06/26/4-5.jpg\" style=\"height:337px; width:500px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Gấu x&aacute;m Bắc Mỹ: Lo&agrave;i vật n&agrave;y c&oacute; trọng lượng trung b&igrave;nh l&ecirc;n đến 1,2 tấn c&ugrave;ng chiều cao 2,4m nếu đứng bằng 2 ch&acirc;n. Mặc d&ugrave; cồng kềnh như vậy nhưng ch&uacute;ng c&oacute; thể chạy với tốc độ l&ecirc;n tới 56 km/h, cộng với t&iacute;nh kh&iacute; ưa bạo lực đ&atilde; khiến lo&agrave;i n&agrave;y trở n&ecirc;n đ&aacute;ng sợ.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;<img alt=\"\" class=\"oImage\" src=\"http://img2.news.zing.vn/2013/06/26/5-5.jpg\" style=\"height:333px; width:500px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tr&acirc;u rừng ch&acirc;u Phi: Lo&agrave;i n&agrave;y l&agrave; một trong những động vật nguy hiểm nhất tr&ecirc;n đất liền.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;<img alt=\"\" class=\"oImage\" src=\"http://img2.news.zing.vn/2013/06/26/6-3.jpg\" style=\"height:333px; width:500px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Voi: Thường được biết đến l&agrave; một lo&agrave;i vật th&acirc;n thiện nhưng h&agrave;nh vi của lo&agrave;i vật n&agrave;y rất kh&oacute; đo&aacute;n biết, đặc biệt l&agrave; khi ch&uacute;ng tức giận. Khi đ&oacute; với trọng lượng to lớn của m&igrave;nh, ch&uacute;ng c&oacute; thể nghiền n&aacute;t bất cứ thứ g&igrave;.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;<img alt=\"\" class=\"oImage\" src=\"http://img2.news.zing.vn/2013/06/26/7-4.jpg\" style=\"height:297px; width:500px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>C&aacute; sấu nước mặn: Đ&acirc;y l&agrave; lo&agrave;i b&ograve; s&aacute;t lớn nhất thế giới, sống ở khắp v&ugrave;ng nhiệt đới ch&acirc;u Phi, ch&acirc;u &Aacute; v&agrave; ch&acirc;u Mỹ. Với chiều d&agrave;i trung b&igrave;nh từ 1,5 m cho đến 6 m c&ugrave;ng h&agrave;m răng c&oacute; thể tạo ra sức đập tương đương với 1,3 tấn, ch&uacute;ng dễ d&agrave;ng kết liễu con mồi.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;<img alt=\"\" class=\"oImage\" src=\"http://img2.news.zing.vn/2013/06/26/9-2.jpg\" style=\"height:333px; width:500px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Rắn: Trong số c&aacute;c lo&agrave;i rắn th&igrave; c&oacute; tới 250 lo&agrave;i c&oacute; khả năng g&acirc;y chết người qua chất độc của m&igrave;nh. Rắn lục l&agrave; lo&agrave;i nguy hiểm nhất.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;<img alt=\"\" class=\"oImage\" src=\"http://img2.news.zing.vn/2013/06/26/10-1.jpg\" style=\"height:376px; width:500px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Muỗi: Mặc d&ugrave; c&oacute; k&iacute;ch thước nhỏ nhất trong danh s&aacute;ch n&agrave;y nhưng đ&acirc;y lại l&agrave; sinh vật nguy hiểm bậc nhất. L&agrave; nguy&ecirc;n nh&acirc;n ch&iacute;nh g&acirc;y l&acirc;y truyền c&aacute;c bệnh như sốt r&eacute;t, v&agrave;ng da, c&aacute;c loại virus g&acirc;y bệnh. Ước t&iacute;nh mỗi năm c&oacute; hơn 1 triệu người tử vong do muỗi.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;<img alt=\"\" class=\"oImage\" src=\"http://img2.news.zing.vn/2013/06/26/8-2.jpg\" style=\"height:351px; width:500px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sư tử ch&acirc;u Phi: Tốc độ l&ecirc;n đến 80 km/h c&ugrave;ng m&oacute;ng vuốt v&agrave; răng sắc như dao cạo đ&atilde; tạo n&ecirc;n t&iacute;nh s&aacute;t thủ bậc nhất cho lo&agrave;i vật n&agrave;y. Ở ch&acirc;u Phi, sư tử đồng nghĩa với c&aacute;i chết, ước t&iacute;nh h&agrave;ng trăm nạn nh&acirc;n thiệt mạng mỗi năm v&igrave; ch&uacute;ng.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo VTC News</p>','10 dã thú nguy hiểm nhất hành tinh','10-da-thu-nguy-hiem-nhat-hanh-tinh',0,0,0,0,0,'','','',''),(16,'2013-09-04 22:08:35','2013-09-04 22:08:35',17,1,1,'Đội mưa, xếp hàng mua bánh Trung thu như thời bao cấp','<div class=\"summary\">\r\n<p>Bất chấp trời mưa, nhiều người d&acirc;n vẫn xếp h&agrave;ng d&agrave;i để mua b&aacute;nh được hộp b&aacute;nh Trung thu tr&ecirc;n đường Thụy Kh&ecirc; (H&agrave; Nội).</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6935.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Người d&acirc;n đội mưa mua b&aacute;nh tại cửa h&agrave;ng b&aacute;n b&aacute;nh Trung thu tr&ecirc;n đường Thụy Kh&ecirc;. Cảnh s&aacute;t giao th&ocirc;ng (CSGT) phải c&oacute; mặt để ph&acirc;n luồng giao th&ocirc;ng, giảm &ugrave;n tắc.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6677.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kh&aacute;ch đỗ xe tr&agrave;n xuống l&ograve;ng đường, nhiều người c&ograve;n kh&ocirc;ng c&oacute; chỗ để.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6931.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Một số người d&acirc;n phải gửi xe ở đối diện cửa h&agrave;ng.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6809.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nh&agrave; h&agrave;ng treo biển th&ocirc;ng b&aacute;o tạm nghỉ, chỉ phục vụ thời điểm 2h chiều, nhưng nhiều kh&aacute;ch vẫn xếp h&agrave;ng để chờ mua b&aacute;nh.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6943.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Thậm ch&iacute; c&ograve;n treo biển hết h&agrave;ng....</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6938.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>... nhưng kh&ocirc;ng ngăn được d&ograve;ng người rồng rắn chờ mua b&aacute;nh.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6827.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>C&ograve;n nh&acirc;n vi&ecirc;n b&aacute;n h&agrave;ng v&agrave; phục vụ mỏi tay.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6946.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Li&ecirc;n tục treo biển v&agrave; với số lượng nhiều.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6771.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Xếp h&agrave;ng, nhiều người cầm sẵn tiền để thanh to&aacute;n v&agrave; lấy b&aacute;nh cho nhanh.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6785.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Mua được b&aacute;nh, đối với nhiều người thật vất vả. Mỗi hộp b&aacute;nh c&oacute; gi&aacute; từ 60.000 - 70.000 đồng.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6853.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Xếp h&agrave;ng mua b&aacute;nh như thời bao cấp, nhưng mỗi người được mua kh&ocirc;ng qu&aacute; 2 hộp b&aacute;nh.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/hieult/2013_09_04/_O7T6739.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Đến tối 4/9, lượng người mua b&aacute;nh tại cửa h&agrave;ng n&agrave;y vẫn đ&ocirc;ng nghịt.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<p>L&ecirc; Hiếu</p>\r\n\r\n<p>Theo Tri Thức</p>','Bất chấp trời mưa, nhiều người dân vẫn xếp hàng dài để mua bánh được hộp bánh Trung thu trên đường Thụy Khê (Hà Nội).','Doi-mua-xep-hang-mua-banh-Trung-thu-nhu-thoi-bao-cap',0,0,0,0,0,'','','',''),(17,'2013-09-04 22:12:08','2013-09-04 22:12:08',18,1,1,'Syria sẽ lại dùng khí độc nếu Obama chùn bước','<div class=\"content\">\r\n<p>Trong phi&ecirc;n thảo luận h&agrave;ng tuần ở hạ viện Anh, một nữ nghị sĩ đối lập hỏi Cameron rằng tại sao &ocirc;ng kh&ocirc;ng vận động Mỹ t&igrave;m kiếm một thỏa thuận ngừng bắn tại Syria thay cho c&aacute;c đợt kh&ocirc;ng k&iacute;ch. Cameron n&oacute;i trước quốc hội rằng Tổng thống Mỹ Barack Obama đ&atilde; c&ocirc;ng bố một lời cảnh b&aacute;o r&otilde; r&agrave;ng đối với Tổng thống Bashar al-Assad của Syria về vũ kh&iacute; h&oacute;a học n&ecirc;n Mỹ phải h&agrave;nh động tới c&ugrave;ng.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/thegioi/2013_09_04/Cameron.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Thủ tướng Anh David Cameron ph&aacute;t biểu trước quốc hội h&ocirc;m 29/8. Ảnh: <em>Reuters.</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&quot;T&ocirc;i chỉ y&ecirc;u cầu b&agrave; ấy (nghị sĩ đối lập) đặt m&igrave;nh v&agrave;o vị thế của Tổng thống Mỹ. &Ocirc;ng ấy đ&atilde; vạch ra một ranh giới r&otilde; r&agrave;ng: Nếu Syria sử dụng vũ kh&iacute; h&oacute;a học với quy m&ocirc; lớn, Mỹ sẽ trừng phạt. Sau khi vạch ra một giới hạn, đưa ra cảnh b&aacute;o, đương nhi&ecirc;n &ocirc;ng ấy kh&ocirc;ng thể lảng tr&aacute;nh vấn đề. Y&ecirc;u cầu &ocirc;ng ấy r&uacute;t lui l&agrave; một h&agrave;nh động nguy hiểm. T&ocirc;i nghĩ c&aacute;c vị sẽ thấy những vụ tấn c&ocirc;ng bằng vũ kh&iacute; h&oacute;a học kh&aacute;c do ch&iacute;nh phủ Syria thực hiện&quot;, Cameron ph&aacute;t biểu.</p>\r\n\r\n<p>Cameron nhắc lại rằng Anh sẽ kh&ocirc;ng tham gia bất kỳ chiến dịch qu&acirc;n sự n&agrave;o chống Syria, nhưng khẳng định thế giới phải tỏ r&otilde; th&aacute;i độ cứng rắn đối với việc ch&iacute;nh phủ của &ocirc;ng Assad d&ugrave;ng vũ kh&iacute; h&oacute;a học.</p>\r\n</div>\r\n\r\n<p>Quỳnh Trang</p>\r\n\r\n<p>Theo Tri Thức</p>','\'Syria sẽ lại dùng khí độc nếu Obama chùn bước\'','Syria-se-lai-dung-khi-doc-neu-Obama-chun-buoc',0,0,0,0,0,'','','',''),(18,'2013-09-04 22:13:53','2013-09-04 22:13:53',19,1,1,'Trẻ em Syria lũ lượt chạy trốn chiến tranh','<div class=\"summary\">\r\n<p>Hơn 2 triệu người, bao gồm h&agrave;ng trăm ngh&igrave;n trẻ em, phải rời bỏ qu&ecirc; hương để tr&aacute;nh những cuộc xung đột trong hơn hai năm qua.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/minhtd/2013_09_04/nan1.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Trong bối cảnh Mỹ v&agrave; đồng minh chuẩn bị tấn c&ocirc;ng Syria, số thường d&acirc;n rời bỏ qu&ecirc; hương đi l&aacute;nh nạn cũng tăng mạnh. Cao ủy Li&ecirc;n Hiệp Quốc về người tị nạn (UNHCR) ng&agrave;y h&ocirc;m qua th&ocirc;ng b&aacute;o, hơn 2 triệu người đ&atilde; vượt qua bi&ecirc;n giới Syria để t&igrave;m cuộc sống b&igrave;nh y&ecirc;n tại c&aacute;c quốc gia l&aacute;ng giềng. <em>Ảnh: AFP</em>.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/minhtd/2013_09_04/nan2.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Em b&eacute; người Syria mệt mỏi tr&ecirc;n tay bố khi đo&agrave;n người tị nạn tới cửa khẩu Cilvegozu của Thổ Nhĩ Kỳ h&ocirc;m 4/9. Tổng thống Nga Vladimir Putin cảnh b&aacute;o về những hậu quả kh&ocirc;n lường phương T&acirc;y khi đơn phương tiến h&agrave;nh kh&ocirc;ng k&iacute;ch Syria. <em>Ảnh: AP.</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/minhtd/2013_09_04/nan3.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Mẹ con một người tị nạn Syria tại khu lều trại nằm ở ngoại &ocirc; th&agrave;nh phố Arbil, thuộc khu vực Kirdistan của Iraq. Theo một b&aacute;o c&aacute;o trong th&aacute;ng 8, số trẻ em Syria buộc phải sống tha hương đ&atilde; vượt qua con số 1 triệu v&agrave; con số n&agrave;y vẫn tiếp tục tăng. Ảnh: <em>Reuters</em>.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/minhtd/2013_09_04/nan4.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Những đứa trẻ hồn nhi&ecirc;n b&ecirc;n ngo&agrave;i cửa khẩu Cilvegozu của Thổ Nhĩ Kỳ h&ocirc;m 2/9, một ng&agrave;y sau khi Mỹ c&ocirc;ng khai c&aacute;o buộc chế độ Assad đứng đằng sau c&aacute;c vụ tấn c&ocirc;ng bằng vũ kh&iacute; h&oacute;a học ở khu vực ngoại &ocirc; thủ đ&ocirc; Damascus hồi th&aacute;ng 8 vừa qua. Ảnh:<em> Reuters.</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/minhtd/2013_09_04/nan5.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Những đứa trẻ chờ bố dựng lều trại ở khu tị nạn nằm c&aacute;ch thủ đ&ocirc; Baghdad của Iraq 360 km về ph&iacute;a Bắc. Đối mặt với cuộc sống kh&oacute; khăn nơi đất kh&aacute;ch qu&ecirc; người nhưng gia đ&igrave;nh n&agrave;y vẫn được xem l&agrave; may mắn bởi rất nhiều người Syria đang phải sống cuộc sống ly t&aacute;n do th&acirc;n nh&acirc;n của họ vẫn mắc kẹt ở v&ugrave;ng chiến sự. Ảnh: <em>Reuters</em>.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/minhtd/2013_09_04/nan6.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>D&ugrave; kh&oacute; khăn, khổ sở nhưng khu lều d&agrave;nh cho người tịn nạn vẫn l&agrave; đ&iacute;ch đến của rất nhiều thường d&acirc;n Syria. Ở đ&acirc;y, t&iacute;nh mạng của gia đ&igrave;nh họ được đảm bảo. Những đứa trẻ sẽ kh&ocirc;ng phải đối mặt với nguy cơ chết yểu v&igrave; bom đạn v&agrave; vũ kh&iacute; h&oacute;a học. Ảnh: <em>Reuters</em>.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/minhtd/2013_09_04/nan7.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Sống tị nạn nơi đất kh&aacute;ch qu&ecirc; người, trẻ em Syria phải học c&aacute;ch tự chăm lo cho bản th&acirc;n v&agrave; gia đ&igrave;nh. Những đứa trẻ đi lấy nước gần khu tị nạn ở thị trấn Lebanese, gần bi&ecirc;n giới Syria &ndash; Lebanon ng&agrave;y 28/8. Ảnh:<em> AP</em>.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/minhtd/2013_09_04/nan8.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Phụ nữ v&agrave; trẻ em tị nạn Syria ngồi ph&iacute;a trước một cửa h&agrave;ng đ&atilde; đ&oacute;ng cửa ở Reyhanli, Thổ Nhĩ Kỳ h&ocirc;m 31/8.K&eacute;o d&agrave;i hơn 2 năm, cuộc nội chiến ở Syria đ&atilde; cướp mạng sống của hơn 100.000 người v&agrave; đẩy h&agrave;ng triệu người kh&aacute;c v&agrave;o cảnh lang bạt. Khi cuộc sống kh&ocirc;ng c&ograve;n b&igrave;nh y&ecirc;n, phụ nữ v&agrave; trẻ em lu&ocirc;n l&agrave; những người dễ bị tổn thương bậc nhất trong mọi cuộc chiến tranh. Ảnh:<em> AP</em>.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/minhtd/2013_09_04/nan9.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Người tị nạn mỏi mệt sau h&agrave;nh tr&igrave;nh chạy trốn chiến tranh. Ảnh: <em>Reuters</em>.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/minhtd/2013_09_04/nan10.JPG\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Kh&ocirc;ng ai biết trước tương lai của những đứa trẻ đang sống cuộc sống tị nạn nheo nh&oacute;c ở c&aacute;c quốc gia l&aacute;ng giềng của Syria. Ảnh:<em> Reuters</em>.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<p>Hồng Duy</p>\r\n\r\n<p>Theo Tri Thức</p>','Hơn 2 triệu người, bao gồm hàng trăm nghìn trẻ em, phải rời bỏ quê hương để tránh những cuộc xung đột trong hơn hai năm qua.','Tre-em-Syria-lu-luot-chay-tron-chien-tranh',0,0,0,0,0,'','','',''),(19,'2013-09-04 22:16:37','2013-09-04 22:16:37',20,1,1,'Cá cảnh giá hơn 1 tỷ ở Tây Ninh','<div class=\"summary\">\r\n<p>C&aacute;c loại c&aacute; c&oacute; tiếng như kim long, ng&acirc;n long, la h&aacute;n&hellip;. chưa &ldquo;b&atilde;i triều&rdquo;, th&igrave; một số người đ&atilde; &ldquo;đi tắt đ&oacute;n đầu&rdquo; nu&ocirc;i loại c&aacute; kiểng mới nặng h&agrave;ng trăm kg.</p>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<p>Chơi c&aacute; kiểng l&agrave; c&aacute;i th&uacute; đam m&ecirc; của kh&aacute; nhiều người. Cũng giống như những người chơi hoa kiểng, chim kiểng, nhu cầu của d&acirc;n chơi c&aacute; kiểng lu&ocirc;n thay đổi kh&ocirc;ng ngừng. Ở T&acirc;y Ninh, trong khi c&aacute;c loại c&aacute; c&oacute; tiếng như kim long, ng&acirc;n long, la h&aacute;n&hellip;. chưa &ldquo;b&atilde;i triều&rdquo;, th&igrave; một số người đ&atilde; &ldquo;đi tắt đ&oacute;n đầu&rdquo; thị trường, t&igrave;m t&ograve;i nu&ocirc;i loại c&aacute; kiểng mới. Đ&oacute; l&agrave; c&aacute; hải tượng.</p>\r\n\r\n<div>Đi ti&ecirc;n phong cho xu hướng mới n&agrave;y c&oacute; lẽ l&agrave; &ocirc;ng Ninh, 75 tuổi, ngụ thị trấn T&acirc;n Ch&acirc;u (huyện T&acirc;n Ch&acirc;u, T&acirc;y Ninh). Hiện nay, &ocirc;ng Ninh đang nu&ocirc;i 12 con c&aacute; hải tượng, trung b&igrave;nh mỗi con nặng khoảng 100kg.\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/phuongnt/2013_09_03/ca%20canh.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>C&aacute; hải tượng của &ocirc;ng Ninh đ&atilde; nặng cả trăm k&yacute;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div>Để nu&ocirc;i được lo&agrave;i c&aacute; &ldquo;khủng&rdquo; n&agrave;y, &ocirc;ng phải x&acirc;y một c&aacute;i hồ tương đương hồ bơi d&agrave;nh cho người lớn. Hồ c&aacute; của &ocirc;ng Ninh c&oacute; chiều cao 1,5m, chiều ngang 10m v&agrave; chiều d&agrave;i 20m. B&ecirc;n trong hồ l&aacute;t to&agrave;n bộ bằng gạch men, mục đ&iacute;ch l&agrave; để c&aacute; kh&ocirc;ng bị trầy vi, tr&oacute;c vẩy. Tr&ecirc;n hồ c&oacute; lợp t&ocirc;n cẩn thận để tr&aacute;nh nước mưa v&agrave; l&aacute; c&acirc;y rụng v&agrave;o l&agrave;m &ocirc; nhiễm nước. Xung quanh hồ lắp k&iacute;nh chịu lực, qua đ&oacute; c&oacute; thể ngắm nh&igrave;n c&aacute; bơi lội.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Chủ nh&acirc;n của đ&aacute;m c&aacute; kiểng khổng lồ n&agrave;y phải thu&ecirc; hẳn một nh&acirc;n c&ocirc;ng để chuy&ecirc;n chăm s&oacute;c cho c&aacute;. C&ocirc;ng việc của người n&agrave;y l&agrave; cho c&aacute; ăn mỗi ng&agrave;y v&agrave; cứ nửa th&aacute;ng thay nước cho hồ c&aacute; một lần. Trung b&igrave;nh mỗi con c&aacute; hải tượng mỗi ng&agrave;y ăn 1kg thức ăn. Thức ăn của ch&uacute;ng l&agrave; c&aacute;c loại c&aacute;: m&egrave; vinh, trắm cỏ, ch&eacute;p, sặc, r&ocirc;&hellip; với gi&aacute; khoảng 7.000 - 8.000 đồng/kg.</div>\r\n\r\n<p>&Ocirc;ng Ninh cho biết: &ldquo;T&ocirc;i mua ch&uacute;ng ở nước ngo&agrave;i, nu&ocirc;i đ&atilde; được 5 năm. Hồi mua ch&uacute;ng mới chỉ bằng ng&oacute;n tay c&aacute;i, gi&aacute; mỗi con 1,5 triệu đồng. Hiện nay, 5 con lớn đ&atilde; nặng khoảng 120 kg, 7 con nhỏ khoảng 80 kg. Đ&atilde; c&oacute; người hỏi mua cả đ&agrave;n c&aacute; với gi&aacute; 1,5 tỷ đồng/con nhưng t&ocirc;i chưa muốn b&aacute;n&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>Ở x&atilde; Hiệp T&acirc;n (huyện Ho&agrave; Th&agrave;nh) c&oacute; anh Vũ, 38 tuổi cũng đang nu&ocirc;i 8 con c&aacute; hải tượng. L&uacute;c anh mua, mỗi con c&aacute; hải tượng chỉ bằng ng&oacute;n ch&acirc;n c&aacute;i người lớn nhưng đ&atilde; c&oacute; gi&aacute; 2,5 triệu đồng. Thời gian đầu chưa c&oacute; kinh nghiệm nu&ocirc;i loại c&aacute; n&agrave;y, anh Vũ đ&atilde; bố tr&iacute; hồ nu&ocirc;i c&aacute; gần vườn mai kiểng. Do đ&oacute;, khi anh cho xịt thuốc diệt s&acirc;u rầy cho c&acirc;y mai, hơi thuốc bay v&agrave;o hồ c&aacute; đ&atilde; khiến đ&agrave;n c&aacute; của anh Vũ bị m&ugrave; mắt v&agrave; chết gần hết.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Anh lại phải đầu tư kinh ph&iacute; gầy dựng lại đ&agrave;n c&aacute; kh&aacute;c. Hiện nay đ&agrave;n c&aacute; hải tượng của anh Vũ rất khoẻ mạnh, mau lớn. Chỉ mới nu&ocirc;i được 5 th&aacute;ng m&agrave; mỗi con đ&atilde; to hơn cổ tay người lớn. Anh Vũ cho biết: Loại c&aacute; n&agrave;y rất hiếu động, ch&uacute;ng thường nhảy l&ecirc;n khỏi mặt nước khoảng 0,2 m để đ&ugrave;a giỡn. Ch&uacute;ng tỏ ra rất h&aacute;u ăn. Mỗi buổi chiều đi l&agrave;m về, anh Vũ thường gh&eacute; chợ mua một kg c&aacute; hoặc ếch về l&agrave;m mồi cho ch&uacute;ng.\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/phuongnt/2013_09_03/ca%20canh2.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Hồ nu&ocirc;i c&aacute; hải tượng của &ocirc;ng Ninh tương đương hồ bơi d&agrave;nh cho người lớn.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div>Anh biểu diễn cho ch&uacute;ng t&ocirc;i xem bằng c&aacute;ch cầm con ếch tr&ecirc;n mặt hồ, lập tức mấy con c&aacute; hải tượng bay l&ecirc;n đớp c&aacute;i &ldquo;phập&rdquo;. Anh Vũ th&iacute;ch th&uacute; n&oacute;i: &ldquo;T&ocirc;i đ&atilde; từng nu&ocirc;i nhiều loại c&aacute; kiểng nhưng chưa thấy loại n&agrave;o như lo&agrave;i c&aacute; hải tượng n&agrave;y. Ch&uacute;ng bơi lội rất mạnh dạn, ăn uống t&aacute;o bạo, dễ tạo cho ta cảm gi&aacute;c mạnh. Đi l&agrave;m về, t&ocirc;i chỉ cần cho ch&uacute;ng ăn hoặc ngắm nh&igrave;n ch&uacute;ng đ&ugrave;a giỡn l&agrave; qu&ecirc;n hết cảm gi&aacute;c mệt nhọc&rdquo;.&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>C&aacute; hải tượng c&oacute; t&ecirc;n khoa học l&agrave; Arapaima gigas, c&oacute; nguồn gốc ở Amazon (Brazil), Colombia. Khi trưởng th&agrave;nh c&oacute; thể d&agrave;i tới 5m, nặng tới 400kg. Th&acirc;n c&aacute; dạng tr&ograve;n, khi c&ograve;n nhỏ n&oacute; m&agrave;u xanh x&aacute;m, v&acirc;y đu&ocirc;i đen. Khi trưởng th&agrave;nh v&acirc;y c&aacute; chuyển sang m&agrave;u đỏ, đu&ocirc;i c&oacute; viền cam.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>So với những lo&agrave;i c&aacute; nước ngọt kh&aacute;c, c&aacute; hải tượng mau lớn hơn. Sau một năm tuổi, n&oacute; nặng tới 4-5 kg. C&aacute; 4-5 năm tuổi l&agrave; c&oacute; thể sinh sản, mỗi lứa c&oacute; thể đẻ tới 180.000 trứng. Thức ăn của c&aacute; hải tượng l&agrave; c&aacute;c lo&agrave;i c&aacute; nhỏ. Ch&uacute;ng c&oacute; khả năng săn mồi thiện nghệ bằng c&aacute;ch phi th&acirc;n l&ecirc;n khỏi mặt nước khoảng v&agrave;i m&eacute;t để t&oacute;m cả ch&uacute; chim đang đậu tr&ecirc;n c&acirc;y.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>C&oacute; k&iacute;ch cỡ khủng v&agrave; lại c&oacute; h&igrave;nh d&aacute;ng đẹp, m&agrave;u sắc bắt mắt n&ecirc;n c&aacute; hải tượng được nhiều cư d&acirc;n Nam Mỹ nu&ocirc;i l&agrave;m c&aacute; cảnh. Ở Th&aacute;i Lan, Nhật Bản lo&agrave;i c&aacute; n&agrave;y rất được ưa chuộng. Tuy nhi&ecirc;n, ở nhiều nước phương Đ&ocirc;ng, v&igrave; c&aacute; hải tượng được coi l&agrave; c&aacute; rồng n&ecirc;n người ta ki&ecirc;ng kỵ, kh&ocirc;ng ăn thịt.</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo T&acirc;y Ninh Online</p>','Các loại cá có tiếng như kim long, ngân long, la hán…. chưa “bãi triều”, thì một số người đã “đi tắt đón đầu” nuôi loại cá kiểng mới nặng hàng trăm kg.','Ca-canh-gia-hon-1-ty-o-Tay-Ninh',0,0,0,0,0,'','','',''),(20,'2013-09-04 22:20:13','2013-09-04 22:20:13',21,1,1,'Man United - gã khờ mùa chuyển nhượng hè 2013','<p><strong>Kh&ocirc;ng c&ograve;n hấp dẫn v&igrave; mất Sir Alex</strong></p>\r\n\r\n<p>Sau khi nhận lời tiếp quản chiếc ghế n&oacute;ng từ Sir Alex Ferguson, t&acirc;n HLV David Moyes đ&atilde; được BLĐ Manchester United hứa sẽ bơm rất nhiều tiền để gia cố lực lượng. Với việc được c&aacute;c quan chức tại Old Trafford bật đ&egrave;n xanh, cựu chiến lược gia của Everton ngay lập tức tham gia v&agrave;o thị trường chuyển nhượng.</p>\r\n\r\n<p>Ngo&agrave;i việc tiếp tục theo đuổi h&agrave;ng loạt những mục ti&ecirc;u Sir Alex từng liệt k&ecirc; như Eriksen (Ajax), Matic (Benfica), Wanyama (Celtic), Sneijder (Galatasaray), Modric (Real), Lewandowski (Dortmund), Strootman (PSV)... David Moyes c&ograve;n bổ sung rất nhiều ng&ocirc;i sao kh&aacute;c v&agrave;o danh s&aacute;ch mua sắm như Fabregas, Thiago (Barcelona), Baines, Fellaini (Everton), Oezil (Real), thậm ch&iacute; cả hai si&ecirc;u sao h&agrave;ng đầu thế giới Gareth Bale (Tottenham) v&agrave; Cristiano Ronaldo (Real Madrid).</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/MinhND/2013_09_04/MU1.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Khi Sir Alex c&ograve;n tại vị, rất nhiều ng&ocirc;i sao muốn tới MU.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Tuy nhi&ecirc;n, c&oacute; vẻ như sau khi chia tay Sir Alex, MU kh&ocirc;ng c&ograve;n l&agrave; điểm đến hấp dẫn đối với c&aacute;c cầu thủ. Theo đ&oacute;, hết người n&agrave;y đến người kh&aacute;c lần lượt quay lưng với lời mời từ ph&iacute;a David Moyes. Đ&aacute;ng n&oacute;i l&agrave; sau khi cự tuyệt Quỷ đỏ, một số cầu thủ n&ecirc;u tr&ecirc;n đ&atilde; quyết định chuyển sang những đội b&oacute;ng kh&aacute;c k&eacute;m danh tiếng hơn như trường hợp của Strootman (Roma), Wanyama (Southampton) v&agrave; Eriksen (Tottenham).</p>\r\n\r\n<p>Khi Sir Alex c&ograve;n tại vị, những Modric, Lewandowski hay Sneijder kh&ocirc;ng dưới một lần b&agrave;y tỏ sự ngưỡng mộ với nh&agrave; ĐKVĐ Premier League. Thế nhưng, khi &ldquo;Ng&agrave;i m&aacute;y sấy t&oacute;c&rdquo; đưa ra quyết định nghỉ hưu, những ng&ocirc;i sao n&oacute;i tr&ecirc;n cũng đồng loạt im lặng trước lời đề nghị từ David Moyes. Chưa kể một số ng&ocirc;i sao kh&aacute;c như Daniele De Rossi, Cesc Fabregas v&agrave; Sami Khedira cũng thẳng thừng từ chối sự ch&egrave;o k&eacute;o từ ph&iacute;a Quỷ đỏ.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/MinhND/2013_09_04/photo-1-640x360.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>D&ugrave; sở hữu Fellaini, MU vẫn bị xem l&agrave; thất bại tr&ecirc;n TTCN. Đặc biệt, họ đ&atilde; gần như c&oacute; Strootman, Fabregas, Thiago v&agrave; Coentrao nhưng vẫn để mất v&agrave;o thời khắc quyết định.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Chỉ tới khi c&aacute;nh cửa chuyển nhượng chuẩn bị kh&eacute;p lại, MU mới c&oacute; được chữ k&yacute; của tiền vệ Marouane Fellaini từ Everton. Nhiều người n&oacute;i rằng, đ&acirc;y l&agrave; thương vụ bom tấn. Song nếu nh&igrave;n v&agrave;o sự mua sắm của Tottenham, Chelsea, Man City v&agrave; thậm ch&iacute; cả Arsenal, r&otilde; r&agrave;ng Fellaini cũng chỉ l&agrave; bản hợp đồng b&igrave;nh thường, c&oacute; chăng chỉ nổi hơn một ch&uacute;t so với mặt bằng tại Premier League. T&iacute;nh tổng m&ugrave;a chuyển nhượng, Quỷ đỏ chỉ c&oacute; được 3 t&acirc;n binh, hai trong số đ&oacute; c&ograve;n rất trẻ l&agrave; Guillermo Varela (20 tuổi) v&agrave; Saidy Janko (17 tuổi).</p>\r\n\r\n<p><strong>David Moyes v&agrave; Ed Woodward - hai g&atilde; khờ &#39;săn đầu người&#39;</strong></p>\r\n\r\n<p>Phải thừa nhận Sir Alex c&oacute; tầm ảnh hưởng cực lớn đối với MU. Tuy nhi&ecirc;n, kh&ocirc;ng thể cho rằng việc chiến lược gia người Scotland nghỉ hưu lại khiến MU thất bại to&agrave;n tập tr&ecirc;n thị trường chuyển nhượng. Chắc chắn ph&iacute;a sau đ&oacute; c&ograve;n c&oacute; những nguy&ecirc;n nh&acirc;n kh&aacute;c. Vậy ch&uacute;ng nằm ở đ&acirc;u, v&agrave; ai phải l&agrave; những người đứng ra chịu tr&aacute;ch nhiệm? Muốn t&igrave;m ra c&acirc;u trả lời, h&atilde;y nh&igrave;n v&agrave;o sự t&iacute;ch cực của những người nắm giữ trọng tr&aacute;ch chuyển nhượng.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/MinhND/2013_09_04/mu2013_1.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Những phi vụ bom tấn m&agrave; MU vuột mất ở kỳ chuyển nhượng.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>MU đ&atilde; đưa ra rất nhiều mục ti&ecirc;u, nhưng kh&ocirc;ng một mục ti&ecirc;u n&agrave;o họ theo đuổi gay gắt v&agrave; quyết đo&aacute;n. Tất cả mọi vụ Quỷ đỏ đều theo đuổi một c&aacute;ch nửa vời. Hỏi cầu thủ n&agrave;y kh&ocirc;ng được, họ lại quay sang thuyết phục cầu thủ kia. Cứ vậy mọi chuyện diễn ra từ đầu cho tới cuối kỳ chuyển nhượng. C&oacute; thời điểm tưởng chừng Quỷ đỏ sẽ nhận được sự phục vụ của Leighton Baines v&agrave; Ander Herrera hay Fabio Coentrao, song rốt cục mọi chuyện đ&atilde; kh&ocirc;ng thể xảy ra.</p>\r\n\r\n<p>Trong vụ Gareth Bale, MU thậm ch&iacute; c&ograve;n đưa ra lời đề nghị l&ecirc;n tới 125 triệu bảng, nhiều hơn lời đề nghị của Real tới 38 triệu bảng, vậy m&agrave; cũng chẳng c&oacute; bản hợp đồng n&agrave;o diễn ra. Qua đ&oacute; c&oacute; thể khẳng định tr&aacute;ch nhiệm n&agrave;y thuộc về t&acirc;n Gi&aacute;m đốc điều h&agrave;nh Ed Woodward. C&oacute; vẻ như cựu cử nh&acirc;n khoa Vật l&yacute; học của trường đại học Bristol hoặc c&ograve;n non kinh nghiệm, hoặc kh&ocirc;ng s&acirc;u s&aacute;t với c&aacute;c gi&aacute;m đốc kh&aacute;c. Đơn cử vụ Coentrao đổ bể v&agrave;o ch&uacute;t ch&oacute;t với l&yacute; do l&atilde;ng nh&aacute;ch: Kh&ocirc;ng kịp ho&agrave;n tất giấy tờ gửi l&ecirc;n UEFA.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/MinhND/2013_09_04/Moyes_and_Woodwork.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>GĐĐH Ed Woodward v&agrave; HLV David Moyes phải l&agrave; những người chịu tr&aacute;ch nhiệm ch&iacute;nh về thất bại trong chuyển nhượng của MU h&egrave; vừa qua.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Trong những ng&agrave;y cuối c&ugrave;ng của kỳ chuyển nhượng, khi MU vừa để thua Liverpool, t&acirc;n HLV David Moyes vẫn n&oacute;i cứng MU kh&ocirc;ng cần th&ecirc;m t&acirc;n binh. Vậy bản th&acirc;n người đứng mũi chịu s&agrave;o, người quyết định sự sống c&ograve;n của Quỷ đỏ như David Moyes c&ograve;n chẳng cho thấy bất kỳ dấu hiệu t&iacute;ch cực n&agrave;o trong chuyển nhượng, th&igrave; lấy đ&acirc;u ra sự nỗ lực từ những người kh&aacute;c?</p>\r\n\r\n<p>Vẫn biết David Moyes c&oacute; c&ocirc;ng rất lớn trong việc giữ ch&acirc;n Wayne Rooney khỏi sự ch&egrave;o k&eacute;o của Chelsea, song với h&agrave;ng loạt thương vụ bất th&agrave;nh vừa qua, kh&ocirc;ng biết cựu HLV Everton v&agrave; Gi&aacute;m đốc điều h&agrave;nh Ed Woodward sẽ phải giải tr&igrave;nh thế n&agrave;o với BLĐ MU.</p>\r\n\r\n<p>TIỂU MINH</p>\r\n\r\n<p>Theo Tri Thức</p>\r\n\r\n<p><a href=\"http://news.zing.vn/tag/Fellaini.html\">Fellaini</a> <a href=\"http://news.zing.vn/tag/th%e1%ba%a5t-b%e1%ba%a1i.html\"> thất bại</a> <a href=\"http://news.zing.vn/tag/chuy%e1%bb%83n-nh%c6%b0%e1%bb%a3ng.html\"> chuyển nhượng</a> <a href=\"http://news.zing.vn/tag/MU.html\"> MU</a> <a href=\"http://news.zing.vn/tag/David-Moyes.html\"> David Moyes</a> <a href=\"http://news.zing.vn/tag/Ed-Woodward.html\"> Ed Woodward</a></p>','Nhận được sự hậu thuẫn lớn từ phía ban lãnh đạo MU, song HLV David Moyes chỉ có thể bổ sung vào đội hình Quỷ đỏ một tân binh chất lượng tầm trung.','Man-United-ga-kho-mua-chuyen-nhuong-he-2013',0,0,0,0,0,'','','',''),(21,'2013-09-04 22:21:45','2013-09-04 22:21:45',22,1,1,'Fellaini tự nguyện mất 130 tỷ đồng để gia nhập MU','<p>V&agrave;o những ph&uacute;t cuối c&ugrave;ng của kỳ chuyển nhượng, Manchester United mới gi&agrave;nh được chữ k&yacute; của tiền vệ Marouane Fellaini từ Everton. Đổi lại, nh&agrave; ĐKVĐ Premier League đ&atilde; phải bỏ ra 27,5 triệu bảng để giải ph&oacute;ng bản hợp đồng giữa ng&ocirc;i sao người Bỉ với đội b&oacute;ng v&ugrave;ng Merseyside.</p>\r\n\r\n<p>Lẽ ra với hai năm c&ograve;n lại trong bản giao k&egrave;o với Everton, Fellaini sẽ được hưởng một khoản tiền thưởng kếch x&ugrave; từ vụ chuyển nhượng của m&igrave;nh. N&oacute;i r&otilde; hơn, Everton sẽ phải gửi v&agrave;o t&agrave;i khoản của &ldquo;T&oacute;c x&ugrave;&rdquo; số tiền 4 triệu bảng. Tuy nhi&ecirc;n, tr&ecirc;n thực tế cựu cầu thủ Standard Liege kh&ocirc;ng nhận được một xu n&agrave;o.</p>\r\n\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://img.v3.news.zdn.vn/w660/Uploaded/MinhND/2013_09_04/Fellaini.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fellaini chấp nhận hy sinh 4 triệu bảng để được gia nhập MU.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Tất cả điều n&agrave;y mới được tờ <em>Daily Express</em> l&agrave;m r&otilde;. Tờ b&aacute;o của Anh cho biết MU đ&atilde; trả cho Everton số tiền &iacute;t hơn nhiều so với mức gi&aacute; đ&atilde; c&ocirc;ng bố. Ch&iacute;nh x&aacute;c l&agrave; đội chủ s&acirc;n Old Trafford chỉ trả Everton 23,5 triệu euro. Khoản tiền 4 triệu bảng c&ograve;n lại l&agrave; do Fellaini tự nguyện kh&ocirc;ng nhận để thương vụ diễn ra nhanh hơn.</p>\r\n\r\n<p>Tất nhi&ecirc;n, MU chẳng để Fellaini chịu thiệt sau h&agrave;nh động hy sinh n&agrave;y. C&aacute;c quan chức tại Old Trafford tuy&ecirc;n bố sẽ tăng tr&ecirc;n 100% lương cho Fellaini, để b&ugrave; đắp 4 triệu bảng m&agrave; t&acirc;n binh người Bỉ kh&ocirc;ng nhận được sau vụ chuyển nhượng vừa qua.</p>\r\n\r\n<p>Ngay sau khi tuyển mộ th&agrave;nh c&ocirc;ng Fellaini, MU bất ngờ tr&igrave;nh l&agrave;ng bản hợp đồng thứ 3 trong h&egrave; năm nay. Đ&oacute; l&agrave; hậu vệ trẻ 17 tuổi người Thụy Sỹ, Saidy Janko. Janko l&agrave; một cầu thủ đa năng, c&oacute; thể chơi mọi vị tr&iacute; ở h&agrave;nh lang phải của MU.</p>\r\n\r\n<p>TIỂU MINH</p>\r\n\r\n<p>Theo Tri Thức</p>','Để được khoác áo Quỷ đỏ, Marouane Fellaini chấp nhận hy sinh 4 triệu bảng (tương đương khoảng 130 tỷ đồng) tiền thưởng từ Everton.','Fellaini-tu-nguyen-mat-130-ty-dong-de-gia-nhap-MU',0,0,0,0,0,'','','',''),(22,'2013-11-13 15:53:59','2014-04-04 16:51:06',23,1,1,'Thể lệ','<p style=\"text-align:center\"><span style=\"color:rgb(0, 255, 0)\"><span style=\"font-size:22px\"><strong>UỐNG CHAI S&Agrave;NH ĐIỆU</strong></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:rgb(0, 255, 0)\"><span style=\"font-size:22px\"><strong>G&Oacute;P XANH M&Ocirc;I TRƯỜNG</strong></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(255, 255, 0)\"><strong>1. GIỚI THIỆU CHƯỜNG TR&Igrave;NH</strong></span></p>\r\n\r\n<p>Hưởng ứng chiến dịch&nbsp;<span style=\"color:rgb(0, 255, 0)\">&ldquo;<strong>Uống Chai S&agrave;nh Điệu, G&oacute;p Xanh M&ocirc;i Trường</strong>&rdquo;</span>&nbsp;của c&ocirc;ng ty Suntory Pepsico Vietnam, Zing Me tổ chức cuộc thi ảnh với mong muốn t&igrave;m ra những h&igrave;nh ảnh đẹp, mang th&ocirc;ng điệp &yacute; nghĩa của c&aacute;c bạn trẻ năng động nhằm mục đ&iacute;ch c&ugrave;ng thương hiệu Pepsi chung tay g&oacute;p xanh m&ocirc;i trường.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(255, 255, 0)\"><strong>2. ĐỐI TƯỢNG DỰ THI</strong></span></p>\r\n\r\n<p>Cộng đồng Zing Me đang sinh sống &amp; l&agrave;m việc tại Việt Nam đ&atilde; like Fanpage Zing Me Pepsi Think and Drink</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(255, 255, 0)\"><strong>3. THỜI GIAN DỰ THI</strong></span></p>\r\n\r\n<p>Bắt đầu từ ng&agrave;y 11/11 &amp; kết th&uacute;c v&agrave;o ng&agrave;y 5/12/2013</p>\r\n\r\n<p>C&ocirc;ng bố kết quả v&agrave;o ng&agrave;y 6/12/2013</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(255, 255, 0)\"><strong>4. C&Aacute;CH THỨC DỰ THI &amp; GIẢI THƯỞNG</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(0, 255, 0)\"><strong>A. C&Aacute;CH THỨC DỰ THI</strong></span></p>\r\n\r\n<p>- Th&iacute; sinh chụp h&igrave;nh c&ugrave;ng c&aacute;c chai thủy tinh của 1 trong 5 thương hiệu nước uống sau:&nbsp;<span style=\"color:rgb(0, 255, 0)\"><strong>Pepsi, Sting, Twister, 7up, Mirinda&nbsp;</strong></span>v&agrave; gửi b&agrave;i dự thi về chương tr&igrave;nh.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;<strong>Y&ecirc;u cầu h&igrave;nh ảnh:</strong>&nbsp;l&agrave; h&igrave;nh tự chụp chưa tham dự bất k&igrave; cuộc thi n&agrave;o, c&oacute; thể tự do s&aacute;ng tạo ở mọi g&oacute;c độ, cho ph&eacute;p xử l&yacute; m&agrave;u sắc &amp; th&ecirc;m th&ocirc;ng tin h&igrave;nh ảnh cho sinh động (gắn chữ &amp; những nh&acirc;n vật, icon ngộ nghĩnh&hellip;), đặc biệt h&igrave;nh phải r&otilde; n&eacute;t về logo của c&aacute;c sản phẩm. Tuyệt đối kh&ocirc;ng sao ch&eacute;p &nbsp;từ người kh&aacute;c hoặc Photoshop lắp gh&eacute;p ảnh để l&agrave;m b&agrave;i dự thi.</p>\r\n\r\n<p>Sẽ c&oacute; những phần qu&agrave; hấp dẫn mỗi ng&agrave;y &amp; to&agrave;n chương tr&igrave;nh. C&oacute; 2 c&aacute;ch dự thi:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"color:rgb(255, 0, 0)\">a. C&aacute;ch 1</span>:</strong>&nbsp;th&iacute; sinh gửi h&igrave;nh dự thi trực tiếp l&ecirc;n tường nh&agrave; Fanpage&nbsp; Zing Me của Pepsi Think and Drink &amp; gắn hashtag&nbsp;<span style=\"color:rgb(0, 255, 0)\"><strong>#pepsichaithuytinh</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://d.f16.photo.zdn.vn/upload/original/2013/11/13/14/17/974718095_463598146_574_574.jpg\" style=\"height:287px; width:479px\" /></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:rgb(255, 255, 0)\"><em>Một mẫu hashtag l&ecirc;n tường nh&agrave; Zing Me hợp lệ</em></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(255, 0, 0)\"><strong>b. C&aacute;ch 2:</strong></span>&nbsp;th&iacute; sinh gửi b&agrave;i dự thi v&agrave;o ứng dụng Think &amp; Drink hoặc&nbsp;<a href=\"http://me.zing.vn/b/t/pepsi.vietnam?t=fp_pepsi_vietnam\" target=\"_top\"><span style=\"color:rgb(255, 255, 0)\"><strong><em>click v&agrave;o đ&acirc;y</em></strong></span></a><span style=\"color:rgb(255, 255, 0)\">&nbsp;</span>để đăng b&agrave;i dự thi của m&igrave;nh</p>\r\n\r\n<p>- Sau khi BTC duyệt b&agrave;i xong, bạn c&oacute; thể chia sẻ b&agrave;i dự thi của m&igrave;nh để mọi người tiến h&agrave;nh b&igrave;nh chọn nhằm sở hữu những giải thưởng c&oacute; gi&aacute; trị nhất</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(0, 255, 0)\"><strong>B. GIẢI THƯỞNG</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(0, 255, 0)\"><strong>a. MỖI NG&Agrave;Y&nbsp;(d&agrave;nh cho th&iacute; sinh dự thi Hashtag)</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>+&nbsp;<strong>63 giải hashtag s&agrave;nh điệu</strong>&nbsp;trị gi&aacute;&nbsp;<strong>1 &aacute;o Pepsi/giải:</strong>&nbsp;d&agrave;nh cho th&iacute; sinh gửi h&igrave;nh hashtag hợp lệ l&ecirc;n tường nh&agrave; Fanpage&nbsp;<span style=\"color:rgb(0, 255, 0)\"><strong>Pepsi Think and Drink</strong></span>. Cuối mỗi ng&agrave;y, BTC sẽ chọn ra 3 th&iacute; sinh gửi nhiều h&igrave;nh hashtag&nbsp;<span style=\"color:rgb(0, 255, 0)\"><strong>#pepsichaithuytinh&nbsp;</strong></span>hợp lệ nhất về Fanpage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>+&nbsp;<strong>105 giải hashtag ấn tượng</strong>&nbsp;trị gi&aacute;&nbsp;<strong>50K/giải</strong>: d&agrave;nh cho th&iacute; sinh gửi h&igrave;nh hashtag hợp lệ l&ecirc;n tường nh&agrave; Fanpage&nbsp;<strong><span style=\"color:rgb(0, 255, 0)\">Pepsi Think and Drink</span></strong>. Cuối mỗi ng&agrave;y, BTC sẽ chọn ra 5 th&iacute; sinh c&oacute; h&igrave;nh ảnh hashtag đẹp &amp; ấn tượng nhất.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>+ 1050 giải hashtag may mắn&nbsp;</strong>trị gi&aacute;<strong>&nbsp;100 Zing Xu/giải:</strong>&nbsp;d&agrave;nh cho th&iacute; sinh gửi h&igrave;nh hashtag hợp lệ l&ecirc;n tường nh&agrave; Fanpage&nbsp;<span style=\"color:rgb(0, 255, 0)\"><strong>Pepsi Think and Drink</strong></span>. Cuối mỗi ng&agrave;y, BTC sẽ chọn ra 50 th&iacute; sinh may mắn gửi h&igrave;nh hashtag&nbsp;<span style=\"color:rgb(0, 255, 0)\"><strong>#pepsichaithuytinh&nbsp;</strong></span>về Fanpage.</p>\r\n\r\n<p><span style=\"color:rgb(255, 0, 0)\"><strong>*Quy định nhận giải: Tất cả những giải thưởng n&agrave;y sẽ được trao v&agrave;o cuối chương tr&igrave;nh</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(0, 255, 0)\"><strong>b. CHUNG CUỘC&nbsp;(d&agrave;nh cho th&iacute; sinh dự thi tr&ecirc;n ứng dụng Think &amp; Drink)</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>+&nbsp;<strong>01 Giải nhất:</strong>&nbsp;d&agrave;nh cho th&iacute; sinh c&oacute; số lượng b&igrave;nh chọn hợp lệ cao nhất. Giải thưởng l&agrave; tiền mặt trị gi&aacute;&nbsp;<strong>3,000,000 VND</strong>&nbsp;(Ba triệu đồng)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;+&nbsp;<strong>02 Giải nh&igrave;:</strong>&nbsp;d&agrave;nh cho th&iacute; sinh c&oacute; số lượng b&igrave;nh chọn hợp lệ cao nh&igrave;. Giải thưởng l&agrave; tiền mặt trị gi&aacute;&nbsp;<strong>1,500,000 VND</strong>&nbsp;(Một triệu năm trăm ngh&igrave;n đồng)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>+&nbsp;<strong>03 Giải ba:</strong>&nbsp;d&agrave;nh cho th&iacute; sinh c&oacute; số lượng h&igrave;nh hợp lệ nhiều nhất. Giải thưởng l&agrave; tiền mặt trị gi&aacute;&nbsp;<strong>500,000 VND</strong>&nbsp;(Năm trăm ngh&igrave;n đồng)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>+&nbsp;<strong>10 Giải Khoảnh khắc S&agrave;nh Điệu:</strong>&nbsp;d&agrave;nh cho 10 th&iacute; sinh c&oacute; h&igrave;nh chụp nghệ thuật c&oacute; 5 sản phẩm&nbsp;<span style=\"color:rgb(0, 255, 0)\"><strong>Pepsi, Sting, Twister, 7up, Mirinda&nbsp;</strong></span>(c&oacute; thể chấp nhận 5 h&igrave;nh đơn cho từng sản phẩm) đầu tư chỉnh sửa ấn tượng.&nbsp; Giải thưởng l&agrave; tiền mặt trị gi&aacute;&nbsp;<strong>500,000 VND</strong>&nbsp;(Năm trăm ngh&igrave;n đồng) + 1 &aacute;o Pepsi s&agrave;nh điệu cho mỗi giải.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>+&nbsp;<strong>27 giải Sống Trọn Từng Gi&acirc;y:</strong>&nbsp;d&agrave;nh cho 27 th&iacute; sinh c&oacute; số lượng h&igrave;nh hợp lệ nhiều tiếp theo. Giải thưởng l&agrave; 1 chiếc &aacute;o Pepsi s&agrave;nh điệu</p>\r\n\r\n<p><span style=\"color:rgb(255, 0, 0)\"><strong>*Quy định nhận giải: Một user nếu tr&uacute;ng thưởng ở 2 hạng mục giải chung cuộc th&igrave; chỉ nhận được 1 giải cao nhất. Giải sẽ được trao v&agrave;o cuối chương tr&igrave;nh</strong></span></p>','Hưởng ứng chiến dịch “Uống Chai Sành Điệu, Góp Xanh Môi Trường” của công ty Suntory Pepsico Vietnam, Zing Me tổ chức cuộc thi ảnh với mong muốn tìm ra những hình ảnh đẹp, mang thông điệp ý nghĩa của các bạn trẻ năng động nhằm mục đích cùng thương hiệu Pepsi chung tay góp xanh môi trường.\r\nĐể nhận được các phần quà xinh xắn của BTC các bạn chỉ cần tham gia bằng tài khoản ZingMe, sau đó đăng hình ảnh để các bạn khác bình chọn, thật dễ dàng phải không nào?? Hãy cùng tham gia nhé!!','The-le',0,1,0,0,0,'','','',''),(23,'2013-11-13 15:57:05','2014-04-04