''),(26,'2013-11-15 11:47:10','2013-11-15 13:32:22',27,1,1,'Lốc xoáy hất văng nữ sinh lớp 5 xuống vực','<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"tplCaption\" style=\"background-color:rgb(244, 245, 246); color:rgb(0, 0, 0); font-family:times new roman; font-size:16px; line-height:normal; min-width:1px; width:300px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align: middle; text-align: center;\"><img alt=\"15-11-Anh-1-Mua-gio-lon-6863-1384482852.\" src=\"http://m.f29.img.vnecdn.net/2013/11/15/15-11-Anh-1-Mua-gio-lon-6863-1384482852.jpg\" style=\"float:left\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:middle\">\r\n			<p>Mưa gi&oacute; lớn g&acirc;y ngập nhiều tuyến đường ở Quảng Ng&atilde;i s&aacute;ng nay. Ảnh:&nbsp;<em>Tr&iacute; T&iacute;n.</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p>Trao đổi với&nbsp;<em>VnExpress,&nbsp;</em>&ocirc;ng L&ecirc; Quang Tịnh, Ph&oacute; chủ tịch UBND huyện Nghĩa H&agrave;nh cho biết, l&uacute;c 6h h&ocirc;m nay, do ảnh hưởng ho&agrave;n lưu &aacute;p thấp nhiệt đới, lốc xo&aacute;y cường độ mạnh đ&atilde; cuốn phăng em Vương Thị Thu Thủy, học sinh lớp 5C, tiểu học Nghĩa H&agrave;nh, đang tr&ecirc;n đường đến trường, rơi xuống vực b&ecirc;n cầu D&agrave;i. L&uacute;c n&agrave;y nước lũ đang cuồn cuộn tr&agrave;n về n&ecirc;n Thủy bị chết đuối.</p>\r\n\r\n<p>&quot;Người d&acirc;n đi đường ph&aacute;t hiện chiếc cặp nổi tr&ecirc;n mặt nước lũ đ&atilde; tổ chức cứu vớt, h&ocirc; hấp nh&acirc;n tạo nhưng em Thủy kh&ocirc;ng qua khỏi&quot;, &ocirc;ng Tịnh n&oacute;i. Mưa lớn k&eacute;o d&agrave;i suốt từ đ&ecirc;m qua đến s&aacute;ng nay khiến cho mực nước lũ tr&ecirc;n c&aacute;c s&ocirc;ng, suối d&acirc;ng cao, g&acirc;y c&ocirc; lập nhiều khu d&acirc;n cư ở huyện Nghĩa H&agrave;nh.</p>\r\n\r\n<p>Theo &ocirc;ng Tịnh, nhiều khu vực d&acirc;n cư ở x&atilde; H&agrave;nh Dũng, H&agrave;nh T&iacute;n T&acirc;y... đ&atilde; ngập s&acirc;u trong lũ g&acirc;y chia cắt giao th&ocirc;ng. Hơn 600 học sinh c&aacute;c cấp ở hai x&atilde; n&agrave;y phải nghỉ học trong h&ocirc;m nay.</p>\r\n\r\n<p>Trong khi đ&oacute;, lũ d&acirc;ng cao tr&agrave;n về cũng g&acirc;y ngập s&acirc;u nhiều tuyến đường, khu d&acirc;n cư ở nhiều x&atilde; Sơn Cao, Sơn Linh, Sơn Thủy, Sơn Kỳ, Sơn Ba của&nbsp;<strong><span style=\"color:rgb(105, 105, 105)\">huyện miền n&uacute;i Sơn H&agrave;</span></strong>.&nbsp;<span style=\"font-size:11.8pt\">B&agrave; Nguyễn Thị Th&agrave;nh, Trưởng ph&ograve;ng gi&aacute;o dục &amp; đ&agrave;o tạo huyện Sơn H&agrave; cho biết th&ecirc;m, nước tr&ecirc;n s&ocirc;ng Rin đ&atilde; tr&agrave;n qua g&acirc;y ngập c&aacute;c tuyến đường, trường học ở c&aacute;c x&atilde; n&ecirc;n h&ocirc;m nay c&oacute; hơn 3.000 học sinh phải nghỉ học để đảm bảo an to&agrave;n.</span></p>\r\n\r\n<p>Tại<strong><span style=\"color:rgb(105, 105, 105)\">&nbsp;huyện miền n&uacute;i Ba Tơ</span></strong>, nước lũ tr&agrave;n về bất ngờ g&acirc;y ngập s&acirc;u, c&ocirc; lập 6 hộ d&acirc;n ở th&ocirc;n Mang Đen, x&atilde; Ba V&igrave;. &quot;Ch&uacute;ng t&ocirc;i đ&atilde; tổ chức đưa 4 hộ d&acirc;n từ khu vực cồn giữa đồng đến nơi an to&agrave;n, vẫn c&ograve;n 2 hộ nữa đang k&ecirc;u cứu nhưng chưa thể tiếp cận do lũ chảy xiết&quot;, &ocirc;ng<span style=\"font-size:11.8pt\">&nbsp;Huỳnh Thương, Ph&oacute; chủ tịch UBND huyện Ba Tơ lo lắng.</span></p>\r\n\r\n<table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"tplCaption\" style=\"background-color:rgb(244, 245, 246); color:rgb(0, 0, 0); font-family:times new roman; font-size:16px; line-height:normal; min-width:1px; width:300px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:middle\"><img alt=\"15-11-Anh-2-Mua-gio-lon-5453-1384482852.\" src=\"http://m.f29.img.vnecdn.net/2013/11/15/15-11-Anh-2-Mua-gio-lon-5453-1384482852.jpg\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:middle\">\r\n			<p>Mưa lớn k&eacute;o d&agrave;i&nbsp;tiếp tục g&acirc;y sạt lở n&uacute;i nghi&ecirc;m trọng, tắc nghẽn giao th&ocirc;ng ở huyện miền n&uacute;i Sơn T&acirc;y.&nbsp;<em>Ảnh: Tr&iacute; T&iacute;n.</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:11.8pt\">Tương tự, ở&nbsp;<strong><span style=\"color:rgb(105, 105, 105)\">huyện Sơn T&acirc;y</span></strong>, mưa gi&oacute; lớn tiếp tục g&acirc;y sạt lở n&uacute;i nghi&ecirc;m trọng, tắc nghẽn giao th&ocirc;ng tr&ecirc;n nhiều tuyến đường từ trung t&acirc;m huyện về c&aacute;c x&atilde;. &Ocirc;ng L&ecirc; Văn T&ugrave;ng, chủ tịch UBND huyện cho biết, c&oacute; khoảng 40 điểm sạt lở n&uacute;i lớn sau si&ecirc;u b&atilde;o Haiyan chưa kịp khắc phục, giờ tiếp tục sạt lở th&ecirc;m do ảnh hưởng ho&agrave;n lưu &aacute;p thấp nhiệt đới. &quot;H&agrave;ng chục ngh&igrave;n khối đất đ&aacute; tr&agrave;n xuống chắn ngang đường. Sớm nhất hai tuần nữa mới c&oacute; thể khắc phục tạm cho người d&acirc;n đi lại&quot;, &ocirc;ng T&ugrave;ng n&oacute;i.</span></p>\r\n\r\n<p>Để đảm bảo an to&agrave;n t&iacute;nh mạng cho người d&acirc;n, Ban chỉ huy ph&ograve;ng chống lụt b&atilde;o &amp; t&igrave;m kiếm cứu nạn Quảng Ng&atilde;i y&ecirc;u cầu c&aacute;c địa phương triển khai phương &aacute;n ph&ograve;ng, chống lũ theo cấp b&aacute;o động nguy hiểm. Sẵn s&agrave;ng phương &aacute;n di dời, sơ t&aacute;n d&acirc;n ra khỏi v&ugrave;ng trũng thấp, sạt lở ven s&ocirc;ng, ven biển, v&ugrave;ng sạt lở n&uacute;i v&agrave; hạ du c&aacute;c hồ chứa.</p>\r\n\r\n<p>Sở gi&aacute;o dục &amp; đ&agrave;o tạo chỉ đạo c&aacute;c trường, t&ugrave;y theo t&igrave;nh h&igrave;nh mưa lũ thực tế của địa phương chủ động cho học sinh nghỉ học, kh&ocirc;ng cho học sinh đi lại qua những đoạn đường bị ngập, nước chảy xiết; ph&acirc;n c&ocirc;ng người canh g&aacute;c 24/24 tại c&aacute;c khu vực n&agrave;y v&agrave; c&aacute;c tuyến đường thường xuy&ecirc;n bị sạt lở; duy tr&igrave; lực lượng, phương tiện cứu hộ, cứu nạn để sẵn s&agrave;ng ứng cứu khi c&oacute; y&ecirc;u cầu.</p>\r\n\r\n<p>&nbsp;</p>','Do ảnh hưởng của áp thấp nhiệt đới, sáng 15/11, lốc xoáy bất ngờ xuất hiện đã hất văng một nữ sinh ở huyện Nghĩa Hành, Quảng Ngãi xuống vực, tử vong. Lũ cũng đang tràn về khiến nhiều khu vực ở địa phương này bị cô lập.','Loc-xoay-hat-vang-nu-sinh-lop-5-xuong-vuc',0,0,0,0,0,'','','','');

/*Table structure for table `articles` */

DROP TABLE IF EXISTS `articles`;

CREATE TABLE `articles` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  `user_id` bigint(20) DEFAULT NULL,
  `thumbnail_image` varchar(255) DEFAULT NULL,
  `is_allow_comment` tinyint(1) DEFAULT '0' COMMENT '0-no comment; 1-yes',
  `is_hot` tinyint(1) DEFAULT '0' COMMENT '0-normal; 1-hot',
  `is_publish` tinyint(1) DEFAULT '0' COMMENT '0-draft; 1-publish',
  `is_delete` tinyint(1) DEFAULT '0' COMMENT '0-no; 1-yes',
  `counter_vote` int(10) DEFAULT '0',
  `vote_point` int(10) DEFAULT '0',
  `average_voting_point` tinyint(3) DEFAULT '0',
  `counter_like` int(10) DEFAULT '0',
  `publish_date` datetime DEFAULT NULL,
  `counter_comment` int(10) DEFAULT '0',
  `counter_view` int(10) DEFAULT '0',
  `data_category` text,
  `user_ip` varchar(40) DEFAULT NULL,
  `article_status_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
