insert  into `html_templates`(`id`,`created`,`modified`,`name`,`content`,`ext`,`is_default`,`resource_id`,`user_id`) values (1,'2011-11-24 16:42:56','2011-11-24 16:42:56','frontend__css__screen','/**************************/\r\n/*        CSS reset       */\r\n/**************************/\r\nhtml, body, div, span, applet, object, iframe,\r\nh1, h2, h3, h4, h5, h6, p, blockquote, pre,\r\na, abbr, acronym, address, big, cite, code,\r\ndel, dfn, em, font, img, ins, kbd, q, s, samp,\r\nsmall, strike, strong, sub, sup, tt, var,\r\nb, u, i, center,\r\ndl, dt, dd, ol, ul, li,\r\nfieldset, form, label, legend {margin:0; padding:0; border:0; outline:0; font-size:100%; vertical-align:baseline; background:transparent;}\r\nol, ul {list-style:none;}\r\nblockquote, q {quotes:none;}\r\nblockquote:before, blockquote:after,\r\nq:before, q:after {content:\'\'; content:none;}\r\n:focus {outline:0;}\r\nins {text-decoration:none;}\r\ndel {text-decoration:line-through;}\r\ncaption, th, td {text-align: left; font-weight: normal;}\r\ntable, caption, tbody, tfoot, thead, tr, th, td {font-size:100%; vertical-align:baseline; outline:0; margin:0; padding:0;}\r\ntable { border-collapse:collapse; border-spacing: 0;}\r\n/******* Default rules tags *******/\r\nhtml {filter:expression(document.execCommand(\"BackgroundImageCache\", false, true));} /* enable background image caching in IE6 */\r\nbody {font: 12px Arial, Helvetica, sans-serif; color:#fff; background:#010338  url(../images/bgd_body.jpg) center 0 no-repeat; }\r\nh1 {font-size:20px;}\r\nh2 {font-size:18px; }\r\nh3 {font-size:16px;}\r\nh4 {font-size:14px;}\r\nh5 {font-size:12px;}\r\na{text-decoration:none; color:#fff;}\r\na:hover{text-decoration:underline; cursor: pointer;}\r\ninput, select, textarea {font-family: Arial, Helvetica, sans-serif ;}\r\n.hidden {display: none;}\r\nhtml { min-height: 100%;}\r\n/*Structure all templates*/\r\n#container { width: 1000px; margin: 0 auto;}\r\n#header, #main, #footer, .hlBar { width: 100%; float: left; clear: both;}\r\n/*******Header*******/\r\n#header .topNav { float: right; font-size: 11px; padding: 10px 15px 0 0;}\r\n#header .topNav li { display: inline;}\r\n#header .topNav li a { color: #fff; text-decoration: none;}\r\n#header .topNav li a:hover { text-decoration: underline;}\r\n#header .topNav li span { padding: 0 10px;}\r\n#header #logo { float: left; padding-right: 14px; width: 235px;}\r\n#header #logo .barOpt { background: url(../images/bgd_repeat_x.png) 0 0 repeat-x; height: 25px;  font-size: 11px; padding: 7px 0 0 10px;}\r\n#header #logo .barOpt a, #header #logo .barOpt span { float: left; padding-right: 5px;}\r\n#header #logo .barOpt a { margin-top: 2px;}\r\n#header .adBanner { float: left; background: url(../images/bgd_repeat_x.png) 0 -80px; height: 113px; padding: 6px; margin-top: 15px;}\r\n/*******main*******/\r\n#main { background: url(../images/bgd_opt.png) repeat; padding: 8px; width: 982px;}\r\n#nav { background: url(../images/bgd_repeat_x.png) 0 -240px repeat-x; height: 35px; width: 100%; float: left; clear: both;}\r\n#nav  ul {float: left; }\r\n#nav li { float: left;background:url(../images/ico.png) 100% -320px no-repeat; height: 35px; padding-right: 2px; position: relative;}\r\n#nav li a { float: left; padding: 7px 16px 0 16px; height: 28px;}\r\n#nav li a:hover, #nav .active a,  #nav .hover a { background: url(../images/bgd_repeat_x.png) 0 -720px repeat-x;}\r\n.nav-1 { background-position: -560px 1px; width: 74px; height: 20px;}\r\n.nav-2 { background-position: -560px -42px; width: 70px; height: 20px;}\r\n.nav-3 { background-position: -560px -85px; width: 100px; height: 20px;}\r\n.nav-4 { background-position: -560px -128px; width: 114px; height: 20px;}\r\n.nav-5 { background-position: -560px -170px; width: 64px; height: 20px;}\r\n.nav-6 { background-position: -560px -213px; width: 92px; height: 20px;}\r\n\r\na:hover .nav-1, .active .nav-1 { background-position: -720px 1px; }\r\na:hover .nav-2, .active .nav-2  { background-position: -720px -42px; }\r\na:hover .nav-3, .active .nav-3 { background-position: -720px -85px; }\r\na:hover .nav-4, .active .nav-4  { background-position: -720px -128px; }\r\na:hover .nav-5, .active .nav-5  { background-position: -720px -170px;}\r\na:hover .nav-6 , .active .nav-6 { background-position: -720px -213px; }\r\n\r\n#nav ul ul { position: absolute; top: -900em; left: 0; border: 1px solid #39cfce; float:left;}\r\n#nav ul ul li { white-space: nowrap;  height: 27px; padding-right: 0; display: block; float: none; clear: both; background: url(../images/bgd_repeat_x.png) 0 -800px repeat-x;}\r\n#nav ul ul li a { padding: 5px 16px 0 16px; height: 22px; background: url(../images/bgd_repeat_x.png) 0 -800px repeat-x; color: #fff;}\r\n#nav ul ul li a:hover, #nav .active ul a,  #nav .hover ul a { padding: 5px 16px 0 16px; height: 22px; background: url(../images/bgd_repeat_x.png) 0 -800px repeat-x; color: #fff; text-decoration: none;}\r\n#nav .active ul a:hover,  #nav .hover ul a:hover {color: #83cdcc;} \r\n\r\nbutton { padding: 0; margin: 0; width: auto; background: none; border: none;}\r\n.searchBox { float: right; position: static; background:url(../images/bgd_repeat_x.png) 0 -320px no-repeat; padding-left: 15px; margin: 5px 15px 0 0;}\r\n.searchBox  input.ipText { background:url(../images/bgd_repeat_x.png) 0 -360px repeat-x; height: 20px; padding: 2px 0 3px 0; float: left; border: none; width: 170px;}\r\n* html .searchBox  input.ipText { height: 19px;}\r\n.searchBox  .btnSearch{ background:url(../images/ico.png) 0 0 no-repeat; width: 30px; height: 25px; float:left; cursor: pointer; padding: 0; margin: 0; border: none;}\r\n\r\n.hlVideo { width: 980px; height: 346px; background: #000; border: 1px solid #3e4c9a; float: left; clear: both; margin-bottom: 15px;}\r\n.hlVideo .wrapNews { float: left; position: relative; width: 658px; height: 346px;}\r\n.hlVideo .wrapNews .desc { position: absolute; bottom: 0; left: 0; padding: 10px; width: 638px; background: url(../images/bgd_opt.png) repeat