/*Table structure for table `statistic_campaigns` */

DROP TABLE IF EXISTS `statistic_campaigns`;

CREATE TABLE `statistic_campaigns` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(75) COLLATE utf8_unicode_ci DEFAULT NULL,
  `avatar` varchar(105) COLLATE utf8_unicode_ci DEFAULT NULL,
  `start_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  `user_id` int(5) DEFAULT NULL,
  `description` text COLLATE utf8_unicode_ci,
  `ga_id` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `ga_username` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `ga_password` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `db_server` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `db_username` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `db_password` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `db_name` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

